','s:18:\"ваше $1 имя\";'),('ru','messages:imstatus_aim_presence','s:227:\"$1 показывает ваш статус вместе с ссылкой, которая запускает AIM для отправления сообщения, если у пользователя он установлен.\";'),('ru','messages:imstatus_aim_api','s:213:\"$1 показывает ваш статус вместе с ссылкой, которая запускает <b>браузер</b>, с javascript-версий AIM для отправления сообщения.\";'),('ru','messages:imstatus_gtalk_code','s:25:\"ваш код google talk\";'),('ru','messages:imstatus_gtalk_get_code','s:58:\"ваш код google code: получите его на $1\";'),('ru','messages:imstatus_gtalk_height','s:45:\"высота блока, в пикселах.\";'),('ru','messages:imstatus_gtalk_width','s:45:\"ширина блока, в пикселах.\";'),('ru','messages:imstatus_icq_id','s:13:\"ваш ICQ ID\";'),('ru','messages:imstatus_icq_style','s:90:\"числа от 0 до 26 (да, существует 27 доступных стилей).\";'),('ru','messages:imstatus_live_code','s:41:\"ваш id вебсайта Live Messenger\";'),('ru','messages:imstatus_live_get_code','s:310:\"ваш id вебсайта Live Messenger: <strong>это не ваш адрес электронной почты</strong>, вы должны создать его в\n<a href=\"$1\">ваших настройках Live Messenger</a>.\nВ id должны быть буквы и цифры от «$2» до «$3».\";'),('ru','messages:imstatus_skype_nbstyle','s:284:\"Примечание. Если вы выбрали стиль, который является также действием, ваши действия будут переопределены действием, соответствующим выбранному вами стилю.\";'),('ru','messages:imstatus_xfire_size','s:89:\"размер кнопки, от $1 (наибольший) до $2 (наименьший).\";'),('ru','messages:imstatus_yahoo_style','s:134:\"стиль кнопки, от $1 (наименьший) до $2 (наибольший), $3 и $4 для голосовой почты.\";'),('ru','messages:vector','s:78:\"Улучшения интерфейса для темы «Векторное»\";'),('ru','messages:vector-desc','s:134:\"Улучшения пользовательского интерфейса для темы оформления «Векторное»\";'),('ru','messages:vector-collapsiblenav-preference','s:110:\"Разрешить сворачивать блоки в левом меню в теме «Векторное»\";'),('ru','messages:vector-collap