ntent-indent-description','s:12:\"Отступ\";'),('ru','messages:wikieditor-toolbar-help-content-indent-syntax','s:100:\"Обычный текст<br />:Текст с отступом<br />::Текст с отступом\";'),('ru','messages:wikieditor-toolbar-help-content-indent-result','s:121:\"Обычный текст<dl><dd>Текст с отступом<dl><dd>Текст с отступом</dd></dl></dd></dl>\";'),('ru','messages:wikieditor-toolbar-tool-table-example-text','s:216:\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut nec purus diam. Sed aliquam imperdiet nunc quis lacinia. Donec rutrum consectetur placerat. Sed volutpat neque non purus faucibus id ultricies enim euismod.\";'),('ru','messages:wikieditor-toolbar-characters-page-arabicextended','s:15:\"Arabic extended\";'),('ru','messages:wikieditor-toolbar-help-content-rereference-syntax','s:25:\"&lt;ref name=\"test\" /&gt;\";'),('ru','messages:wikieditor-toolbar-help-content-showreferences-syntax','s:20:\"&lt;references /&gt;\";'),('ru','messages:wikieditor-toolbar-help-content-signaturetimestamp-syntax','s:4:\"~~~~\";'),('ru','messages:wikieditor-toolbar-help-content-signature-syntax','s:3:\"~~~\";'),('ru','messages:newestpages','s:27:\"Новые страницы\";'),('ru','messages:newestpages-desc','s:115:\"Показывает [[Special:NewestPages|последние X страниц]] добавленных в вики\";'),('ru','messages:newestpages-header','s:160:\"\'\'\'Эта страница {{PLURAL:$1|является новейшей|входит в список $1 новейших страниц}} этой вики.\'\'\'\";'),('ru','messages:newestpages-limitlinks','s:43:\"Показывать до $1 страниц\";'),('ru','messages:newestpages-namespace','s:34:\"Пространство имён:\";'),('ru','messages:newestpages-none','s:35:\"Не найдено записей.\";'),('ru','messages:newestpages-ns-header','s:216:\"\'\'\'Эта страница {{PLURAL:$1|является новейшей в пространстве имён|входит в список $1 новейших страниц пространства имён}} $2.\'\'\'\";'),('ru','messages:newestpages-showing','s:134:\"Список {{PLURAL:$1|$1 новейшей страницы|$1 новейших страниц|$1 новейших страниц}}:\";'),('ru','messages:newestpages-submit','s:18:\"Выполнить\";'),('ru','messages:newestpages-showredir','s:68:\"Показывать страницы-перенаправления\";'),('ru','messages:newestpages-hideredir','s:60:\"Скрыть страницы-перенаправления\";'),('ru','messages:renameuser','s:45:\"Переименовать участника\";'),('ru','messages:renameuser-linkoncontribs','s:45:\"переименовать участника\";'),('ru','messages:renameuser-linkoncontribs-text','s:56:\"Переименовать этого участника\";'),('ru','messages:renameuser-desc','s:94:\"Переименование участника (требуются права \'\'renameuser\'\')\";'),('ru','messages:renameuserold','s:42:\"Имя в настоящий момент:\";'),('ru','messages:renameusernew','s:18:\"Новое имя:\";'),('ru','messages:renameuserreason','s:44:\"Причина переименования:\";'),('ru','messages:renameusermove','s:139:\"Переименовать также страницу участника, личное обсуждение и их подстраницы\";'),('ru','messages:renameusersuppress','s:77:\"Не создавать перенаправлений на новое имя\";'),('ru','messages:renameuserreserve','s:121:\"Зарезервировать старое имя участника для использования в будущем\";'),('ru','messages:renameuserwarnings','s:29:\"Предупреждения:\";'),('ru','messages:renameuserconfirm','s:51:\"Да, переименовать участника\";'),('ru','messages:renameusersubmit','s:18:\"Выполнить\";'),('ru','messages:renameusererrordoesnotexist','s:93:\"Участник с именем «<nowiki>$1</nowiki>» не зарегистрирован.\";'),('ru','messages:renameusererrorexists','s:95:\"Участник с именем «<nowiki>$1</nowiki>» уже зарегистрирован.\";'),('ru','messages:renameusererrorinvalid','s:74:\"Недопустимое имя участника «<nowiki>$1</nowiki>»\";'),('ru','messages:renameuser-error-request','s:168:\"Возникли затруднения с получением запроса. Пожалуйста, вернитесь назад и повторите ещё раз.\";'),('ru','messages:renameuser-error-same-user','s:121:\"Вы не можете переименовать участника в тоже имя, что и было раньше.\";'),('ru','messages:renameusersuccess','s:100:\"Участник «<nowiki>$1</nowiki>» был переименован в «<nowiki>$2</nowiki>».\";'),('ru','messages:renameuser-page-exists','s:128:\"Страница $1 уже существует и не может быть перезаписана автоматически.\";'),('ru','messages:renameuser-page-moved','s:62:\"Страница $1 была переименована в $2.\";'),('ru','messages:renameuser-page-unmoved','s:78:\"Страница $1 не может быть переименована в $2.\";'),('ru','messages:renameuserlogpage','s:62:\"Журнал переименований участников\";'),('ru','messages:renameuserlogpagetext','s:134:\"Это журнал произведённых переименований зарегистрированных участников.\";'),('ru','messages:renameuserlogentry','s:37:\"переименовал $1 в «$2»\";'),('ru','messages:renameuser-log','s:75:\"$1 {{PLURAL:$1|правка|правки|правок}}. Причина: $2\";'),('ru','messages:renameuser-move-log','s:143:\"Автоматически в связи с переименованием учётной записи «[[User:$1|$1]]» в «[[User:$2|$2]]»\";'),('ru','messages:right-renameuser','s:49:\"переименование участников\";'),('ru','messages:renameuser-renamed-notice','s:149:\"Этот участник был переименован.\nНиже для справки приведён журнал переименований.\";'),('ru','messages:renameuser-summary','s:0:\"\";'),('ru','messages:gadgets-desc','s:193:\"Позволяет участникам выбирать в [[Special:Preferences|настройках]] CSS- и JavaScript-гаджеты, которые они хотят подключить\";'),('ru','messages:prefs-gadgets','s:14:\"Гаджеты\";'),('ru','messages:gadgets-prefstext','s:970:\"Ниже приведён список специальных гаджетов, которые вы можете включить для своей учётной записи.\nЭти гаджеты преимущественно основаны на JavaScript, поэтому вы должны включить JavaScript в своём браузере для того, чтобы они работали.\nУчтите, что эти гаджеты не работают на странице настроек.\n\nТакже учтите, что эти гаджеты не являются частью MediaWiki и обычно разрабатываются и обслуживаются участниками вашей локальной вики.\nАдминистраторы могут изменять список гаджетов с помощью страниц [[MediaWiki:Gadgets-definition|определений]] и [[Special:Gadgets|описаний]].\";'),('ru','messages:gadgets','s:14:\"Гаджеты\";'),('ru','messages:gadgets-title','s:14:\"Гаджеты\";'),('ru','messages:gadgets-pagetext','s:528:\"Ниже приведён список гаджетов, которые участники могут включить на своей странице настроек, в соответствии со списком на странице [[MediaWiki:Gadgets-definition|определений]].\nЭтот список позволяет легко получить доступ к страницам системных сообщений, определяющих описания и исходные коды гаджетов.\";'),('ru','messages:gadgets-uses','s:20:\"Использует\";'),('ru','messages:gadgets-required-rights','s:85:\"{{PLURAL:$2|Требуется право «$1»|Требуются права: $1}}.\";'),('ru','messages:gadgets-default','s:55:\"Включён для всех по умолчанию.\";'),('ru','messages:gadgets-export','s:28:\"Экспортировать\";'),('ru','messages:gadgets-export-title','s:29:\"Экспорт гаджета\";'),('ru','messages:gadgets-not-found','s:38:\"Гаджет «$1» не найден.\";'),('ru','messages:gadgets-export-text','s:737:\"Для экспорта гаджета $1, нажмите кнопку «{{int:gadgets-export-download}}», сохраните загруженный файл, \nперейдите на страницу Special:Import целевой вики и загрузите файл. Затем добавьте следующие строки на страницу MediaWiki:Gadgets-definition: \n<pre>$2</pre>\nВы должны иметь соответствующие разрешения в целевой вики (в том числе право на редактирование системных сообщений), также на сервере должна быть включена настройка импорта из файлов.\";'),('ru','messages:gadgets-export-download','s:18:\"Загрузить\";'),('ru','messages:fileindexer','s:33:\"FileIndexer: Index Uploaded Files\";'),('ru','messages:fileindexer_sp_title','s:33:\"FileIndexer: Index Uploaded Files\";'),('ru','messages:fileindexer_sp_formular_title','s:53:\"Specify the parameters for the index creation process\";'),('ru','messages:fileindexer_sp_description','s:61:\"On this form you may create/update indexes of uploaded files.\";'),('ru','messages:fileindexer_sp_lable_destination_namespace','s:21:\"Destiantion Namespace\";'),('ru','messages:fileindexer_sp_lable_no_updates','s:10:\"No Updates\";'),('ru','messages:fileindexer_sp_lable_wildcard_sign','s:13:\"Wildcard Sign\";'),('ru','messages:fileindexer_sp_lable_file_matches','s:5:\"Files\";'),('ru','messages:fileindexer_sp_lable_submit_check','s:5:\"Check\";'),('ru','messages:fileindexer_sp_lable_submit_create','s:6:\"Create\";'),('ru','messages:fileindexer_sp_help_wildcard_sign','s:65:\"Specify a sign to be used as wildcards in the \'Files\' inputfield.\";'),('ru','messages:fileindexer_sp_help_no_updates','s:117:\"If checked no indexes will be updated. Only new indexes in the articles of the destination namespace will be created.\";'),('ru','messages:fileindexer_sp_help_file_matches','s:105:\"Each line may specify a full filename or may be used to filter many filenames by using the wildcard sign.\";'),('ru','messages:fileindexer_sp_help_file_matches_default_wildcardsign','s:22:\"The wildcard sign is: \";'),('ru','messages:fileindexer_sp_help_destination_namespace','s:95:\"Specify the destination namespace for the articles in which to create/update the files indexes.\";'),('ru','messages:fileindexer_sp_help_submits','s:193:\"By using the button \'Create\' the indexing process will be initiated while using the button \'Check\' will only result in a list of those files titles that would have been indexed by this request.\";'),('ru','messages:fileindexer_sp_msg_response_no_params','s:38:\"You have to spezify at least one file!\";'),('ru','messages:fileindexer_sp_msg_response_files_index_created','s:74:\"For the following list of articles the index creation process was started:\";'),('ru','messages:fileindexer_sp_msg_response_files_index_updated','s:72:\"For the following list of articles the index update process was started:\";'),('ru','messages:fileindexer_sp_msg_response_files_index_update_suppressed','s:75:\"For the following list of articles the index update process was suppressed:\";'),('ru','messages:fileindexer_sp_msg_response_files_not_found','s:47:\"The following list of files could not be found:\";'),('ru','messages:fileindexer_sp_msg_response_files_with_unsupported_filetypes','s:53:\"The following list of files was of unsupported types:\";'),('ru','messages:fileindexer_sp_msg_response_files_to_be_indexed','s:68:\"By this request the following list of files would have been indexed:\";'),('ru','messages:fileindexer_sp_msg_response_systemcheck_command_missing','s:23:\"Systemcommand not found\";'),('ru','messages:fileindexer_sp_msg_response_systemcheck_command_wrong_path','s:47:\"Systemcommandpath incorrect. \'which\' returned: \";'),('ru','messages:fileindexer_form_label_create_index','s:19:\"Create/update index\";'),('ru','messages:fileindexer_sp_index_creation_comment','s:42:\"FileIndexer: Indexcreation by special page\";'),('ru','messages:fileindexer_upl_index_creation_comment','s:36:\"FileIndexer: Indexcreation by upload\";'),('ru','messages:fileindexer_index_creation_complete_comment','s:20:\"-> Creation complete\";'),('ru','messages:fileindexer_index_creation_failed_comment','s:20:\"-> Creation failed: \";'),('ru','messages:fileindexer_index_creation_failed_comment_missing_systemcommand','s:73:\"Systemcheck showed missing or incorrect configurated, dependent commands!\";'),('ru','messages:fileindexer_index_creation_failed_comment_unknown_filetype','s:21:\"Unsupported filetype!\";'),('ru','messages:fileindexer_index_creation_failed_comment_unknown_reason','s:14:\"Unkonwn reason\";'),('ru','messages:fileindexer_index_update_complete_comment','s:18:\"-> Update complete\";'),('ru','messages:fileindexer_msg_missing_dependencies','s:86:\"A systemcheck returned that some dependent applications for indexcreation are missing!\";'),('ru','messages:fileindexer_sp_main_ns','s:4:\"Main\";'),('ru','messages:multipleupload','s:50:\"Загрузка нескольких файлов\";'),('ru','messages:multiupload-desc','s:129:\"Позволяет участникам [[Special:MultipleUpload|загружать несколько файлов за раз]]\";'),('ru','messages:multipleupload-ignoreallwarnings','s:127:\"Игнорировать \'\'\'все предупреждения\'\'\' и сохранять файлы в любом случае.\";'),('ru','messages:multipleupload-saveallfiles','s:36:\"Сохранить все файлы\";'),('ru','messages:multipleupload-addresswarnings','s:143:\"Пожалуйста, рассмотрите все предупреждения перед повторной загрузкой файлов.\";'),('ru','messages:multipleupload-page','s:59:\"{{ns:project}}:Правила удаления файлов\";'),('ru','messages:multipleupload-text','s:690:\"С помощью этой страницы можно загрузить сразу несколько файлов.\n\nНажмите «Обзор» и выберите файл, который вы хотите загрузить. Вы можете загрузить от 1 до $1 файлов за один раз.\n\nВы можете заполнить необязательные поля «Целевое имя файла», указать «Краткие описания» для ваших файлов.\n\nНеподходящие файлы будут удалены немедленно, см. [[{{MediaWiki:Multipleupload-page}}|правила удаления файлов]].\";'),('ru','messages:multiupload-fileuploaded','s:26:\"Файл загружен.\";'),('ru','messages:multiupload-toolbox','s:50:\"Загрузка нескольких файлов\";'),('ru','messages:multiupload-no-files','s:109:\"Пожалуйста, выберите по крайней мере один файл для загрузки\";'),('ru','messages:multiupload-blank','s:38:\"Нет выбранных файлов\";'),('ru','messages:captcha-edit','s:236:\"Чтобы отредактировать эту страницу, пожалуйста, решите простой пример и введите ответ в текстовое поле ([[Special:Captcha/help|подробнее]]):\";'),('ru','messages:captcha-desc','s:114:\"Предоставляет методы CAPTCHA для защиты от спама и подбора пароля\";'),('ru','messages:captcha-addurl','s:272:\"Вы добавили ссылку на внешний сайт;\nв целях защиты от автоматического спама, введите буквы изображённые на картинке:<br />\n([[Special:Captcha/help|Что это такое?]])\";'),('ru','messages:captcha-badlogin','s:326:\"В целях защиты от автоматического взлома пароля, пожалуйста, выполните следующее простое арифметическое действие и введите ответ в текстовое поле ниже ([[Special:Captcha/help|подробнее]]):\";'),('ru','messages:captcha-createaccount','s:301:\"В качестве меры против автоматического спама, вы должны ввести буквы, изображённые на картинке, чтобы зарегистрироваться в системе:<br />\n([[Special:Captcha/help|Что это такое?]])\";'),('ru','messages:captcha-createaccount-fail','s:86:\"Контрольная комбинация неверна или не введена.\";'),('ru','messages:captcha-create','s:187:\"Чтобы создать страницу, решите простой пример и введите ответ в текстовое поле ([[Special:Captcha/help|что это?]]):\";'),('ru','messages:captcha-sendemail','s:249:\"В целях защиты от автоматического спама, пожалуйста, вычислите приведённое простое выражение и введите ответ ([[Special:Captcha/help| подробнее]]):\";'),('ru','messages:captcha-sendemail-fail','s:89:\"Код подтверждения неправильный или отсутствует.\";'),('ru','messages:captcha-disabledinapi','s:142:\"Это действие требует проверки CAPTCHA, и поэтому не может быть выполнено через API.\";'),('ru','messages:captchahelp-title','s:25:\"Справка о CAPTCHA\";'),('ru','messages:captchahelp-cookies-needed','s:119:\"Вам нужно включить куки в браузере, чтобы эта функция заработала.\";'),('ru','messages:captchahelp-text','s:2032:\"Веб-сайты, позволяющие добавлять и изменять своё содержимое, в том числе эта вики, часто становятся целью спамеров, использующих программы для автоматического добавления ссылок на сайты.\nХотя такие ссылки могут быть впоследствии удалены, они являются существенной помехой.\n\nПри некоторых действиях — например, при добавлении на страницу новой веб-ссылки — вы можете увидеть специальную картинку с цветным или искажённым текстом, и вам будет предложено ввести этот искажённый текст.\nТак как распознавание искажённого текста является сложной задачей для программ, то большинство спамерских и вандальных программ не могут с ней справиться, в то время как люди справляются легко.\n\nК сожалению, подобная защита может причинить неудобства людям с ограничениями по зрению или тем, кто использует текстовые или читающие браузеры.\nВ настоящее время у нас нет звуковой альтернативы данной проверке.\nПожалуйста, обратитесь за помощью к [[{{MediaWiki:Grouppage-sysop}}|администраторам]], если подобная проверка мешает вам добросовестно работать с сайтом.\n\nНажмите кнопку «Назад» в вашем браузере, чтобы вернуться к редактированию.\";'),('ru','messages:captcha-addurl-whitelist','s:458:\" #<!-- leave this line exactly as it is --> <pre>\n# Описание синтаксиса:\n#  * Всё, начиная с символа \"#\" и до конца строки считается комментарием\n#  * Каждая непустая строка считается фрагментом регулярного выражения соответствующего имени узла в URL\n  #</pre> <!-- leave this line exactly as it is -->\";'),('ru','messages:right-skipcaptcha','s:119:\"выполнение требующих CAPTCHA-проверки действий без прохождения CAPTCHA\";'),('ru','messages:categorytree','s:31:\"Дерево категорий\";'),('ru','messages:categorytree-portlet','s:18:\"Категории\";'),('ru','messages:categorytree-legend','s:48:\"Показать дерево категорий\";'),('ru','messages:categorytree-desc','s:125:\"AJAX-компонент для отображения [[Special:CategoryTree|структуры категорий]] вики\";'),('ru','messages:categorytree-header','s:409:\"Введите имя категории, и она будет показана в виде дерева.\nЭта возможность доступна, только если ваш браузер поддерживает AJAX.\nЕсли у вас старая версия браузера или отключен JavaScript, показ подкатегорий в виде дерева недоступен.\";'),('ru','messages:categorytree-category','s:19:\"Категория:\";'),('ru','messages:categorytree-go','s:18:\"Загрузить\";'),('ru','messages:categorytree-parents','s:43:\"Родительские категории\";'),('ru','messages:categorytree-mode-categories','s:31:\"только категории\";'),('ru','messages:categorytree-mode-pages','s:23:\"кроме файлов\";'),('ru','messages:categorytree-mode-all','s:23:\"все страницы\";'),('ru','messages:categorytree-collapse','s:16:\"свернуть\";'),('ru','messages:categorytree-expand','s:20:\"развернуть\";'),('ru','messages:categorytree-member-counts','s:228:\"содержит $1 {{PLURAL:$1|подкатегорию|подкатегории|подкатегорий}}, $2 {{PLURAL:$2|страницу|страницы|страниц}} и $3 {{PLURAL:$3|файл|файла|файлов}}\";'),('ru','messages:categorytree