,('ru','messages:smw_result_prev','s:20:\"Предыдущая\";'),('ru','messages:smw_result_next','s:18:\"Следующая\";'),('ru','messages:smw_result_results','s:20:\"Результаты\";'),('ru','messages:smw_result_noresults','s:56:\"Извините, но ничего не найдено.\";'),('ru','messages:smwadmin','s:53:\"Администрирование Semantic MediaWiki\";'),('ru','messages:smw_smwadmin_setupsuccess','s:79:\"Система хранения была успешно установлена.\";'),('ru','messages:smw_smwadmin_return','s:24:\"Вернуться к $1\";'),('ru','messages:smw_smwadmin_updatestarted','s:367:\"Запущен новый процесс обновления семантических данных.\nВсе сохранённые данные будут перестроены и восстановлены, где это необходимо.\nВы можете следить за ходом обновления на этой служебной странице.\";'),('ru','messages:smw_smwadmin_updatenotstarted','s:105:\"Уже запущен один процесс обновления.\nВторой не создаётся.\";'),('ru','messages:smw_smwadmin_updatestopped','s:93:\"Все существующие процессы обновления остановлены.\";'),('ru','messages:smw_smwadmin_updatenotstopped','s:254:\"Чтобы остановить запущенный процесс обновления, вы должны поставить отметку, подтверждающую, что вы действительно уверены в этом решении.\";'),('ru','messages:smw_smwadmin_docu','s:391:\"Эта служебная страница поможет вам в процессе установки и обновления <a href=\"http://semantic-mediawiki.org\">Semantic MediaWiki</a>.\nНе забудьте произвести резервное копирование значимых данных перед выполнением административных действий.\";'),('ru','messages:smw_smwadmin_db','s:64:\"Установка и обновление базы данных\";'),('ru','messages:smw_smwadmin_dbdocu','s:860:\"Semantic MediaWiki требует наличия некоторых расширений к базе данных MediaWiki, позволяющих хранить семантические данные.\nПриведённая ниже функция гарантирует, что ваша база данных установлена корректно.\nИзменения, сделанные на этом шаге, не влияют на основную часть базы данных MediaWiki и могут быть при желании легко отменены.\nХотя эта функция установки может быть выполнена несколько раз не причинив никакого, её запуск необходим только один раз во время установки или обновления.\";'),('ru','messages:smw_smwadmin_permissionswarn','s:751:\"Причиной сбоев при выполнении SQL-команд, может быть отсутствие необходимых прав у пользователя, от имени которого вы подключаетесь к базе данных вики (проверьте ваш LocalSettings.php).\nПредоставьте этому пользователю дополнительные права на создание и удаление таблиц, временно введите логин root в LocalSettings.php, или используйте обслуживающий скрипт <tt>SMW_setup.php</tt>, который может использовать настройки доступа из AdminSettings.php.\";'),('ru','messages:smw_smwadmin_dbbutton','s:67:\"Инициализация или обновление таблиц\";'),('ru','messages:smw_smwadmin_announce','s:40:\"Объявление вашей вики\";'),('ru','messages:smw_smwadmin_announcedocu','s:737:\"У Semantic MediaWiki есть веб-сервис для объявлений новых семантических вики-сайтов.\nОн используется для поддержки списка общественно доступных сайтов, использующих Semantic MediaWiki, это помогает проекту <a href=\"http://semantic-mediawiki.org/wiki/SMW_Project\">Semantic MediaWiki project</a> получить представление о типовых использованиях Semantic MediaWiki.\n<a href=\"http://semantic-mediawiki.org/wiki/Registry\">Более подробную информацию</a> можно найти на домашней странице Semantic MediaWiki.\";'),('ru','messages:smw_smwadmin_announcebutton','s:370:\"Нажмите на следующую кнопку, чтобы отправить адрес вашей вики в этот сервис.\nСервис не будет регистрировать вики, не являются публично доступными, он будет хранить только публично доступную информацию.\";'),('ru','messages:smw_smwadmin_datarefresh','s:65:\"Восстановление и обновление данных\";'),('ru','messages:smw_smwadmin_datarefreshdocu','s:913:\"Можно восстановить все данные Semantic MediaWiki, основанные на текущем содержимом вики.\nЭто может быть полезно для восстановления сломанных данных, обновления данных в случае, если внутренний формат изменился в связи с некоторым обновлением программного обеспечения.\nОбновление будет выполняться страница за страницей и займёт некоторое время.\nНиже показано как идёт процесс обновления, даётся возможность начать или прекратить обновление (если эта функция не была отключена на администратором сайте).\";'),('ru','messages:smw_smwadmin_datarefreshprogress','s:805:\"<strong>Обновление уже запущено.</strong>\nЭто нормально, что процесс обновления идём достаточно медленно, поскольку он обновляет данные лишь небольшими порциями, когда пользователь обращается к вики.\nЧтобы закончить данное обновление быстрее, вы можете вызвать скрипт обслуживания MediaWiki <tt>runJobs.php</tt> (используйте настройку <tt>- maxjobs 1000</tt>, чтобы ограничить количество обновлений в одной партии).\nОриентировочный ход выполнения текущего обновления:\";'),('ru','messages:smw_smwadmin_datarefreshbutton','s:46:\"Начать обновление данных\";'),('ru','messages:smw_smwadmin_datarefreshstop','s:48:\"Остановить это обновление\";'),('ru','messages:smw_smwadmin_datarefreshstopconfirm','s:22:\"Да, я уверен.\";'),('ru','messages:smw_smwadmin_support','s:35:\"Получить поддержку\";'),('ru','messages:smw_smwadmin_supportdocu','s:105:\"Различные ресурсы, которые могут помочь в случае проблем:\";'),('ru','messages:smw_smwadmin_installfile','s:249:\"Если вы испытываете затруднения при установке, прочтите руководство в <a href=\"http://svn.wikimedia.org/svnroot/mediawiki/trunk/extensions/SemanticMediaWiki/INSTALL\">файле INSTALL</a>.\";'),('ru','messages:smw_smwadmin_smwhomepage','s:161:\"Полная документация пользователя Semantic MediaWiki на <b><a href=\"http://semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('ru','messages:smw_smwadmin_mediazilla','s:116:\"Ошибки могут быть сообщены в <a href=\"https://bugzilla.wikimedia.org/\">Багзиллу</a>.\";'),('ru','messages:smw_smwadmin_questions','s:309:\"Если у вас есть дополнительные вопросы или предложения, присоединяйтесь к обсуждению на <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawi