:sf_createproperty_linktoform','s:124:\"Это свойство содержит ссылку на страницы, которые используют форму:\";'),('ru','messages:sf_createproperty_allowedvalsinput','s:347:\"Если вы хотите, чтобы данное свойство могло содержать только определённые значения, введите через запятую список допустимых значений (если значение содержит запятую, то замените её на «\\,»):\";'),('ru','messages:sf_createproperty_propname','s:24:\"Имя свойства:\";'),('ru','messages:sf_createproperty_proptype','s:7:\"Тип:\";'),('ru','messages:templates','s:14:\"Шаблоны\";'),('ru','messages:sf_templates_docu','s:67:\"Следующие шаблоны существуют в вики.\";'),('ru','messages:sf_templates_definescat','s:40:\"определяет категорию:\";'),('ru','messages:createtemplate','s:27:\"Создать шаблон\";'),('ru','messages:sf_createtemplate_namelabel','s:22:\"Имя шаблона:\";'),('ru','messages:sf_createtemplate_categorylabel','s:91:\"Категория, определяемая шаблоном (необязательно):\";'),('ru','messages:sf_createtemplate_templatefields','s:23:\"Поля шаблона\";'),('ru','messages:sf_createtemplate_fieldsdesc','s:263:\"Для указания полей шаблона не требуется указывать их имена, просто введите индекс каждого поля (например, 1, 2, 3 и т. д.) вместо фактического имени.\";'),('ru','messages:sf_createtemplate_fieldname','s:16:\"Имя поля:\";'),('ru','messages:sf_createtemplate_displaylabel','s:40:\"Отображаемая надпись:\";'),('ru','messages:sf_createtemplate_semanticproperty','s:44:\"Семантическое свойство:\";'),('ru','messages:sf_createtemplate_fieldislist','s:115:\"Это поле может содержать список разделённых запятыми значений\";'),('ru','messages:sf_createtemplate_aggregation','s:20:\"Соединение\";'),('ru','messages:sf_createtemplate_aggregationdesc','s:306:\"Чтобы вывести на любую страницу, использующую этот шаблон, все страницы, у которых заданное свойство указывает на эту страницу, укажите соответствующее свойство ниже:\";'),('ru','messages:sf_createtemplate_aggregationlabel','s:32:\"Заголовок списка:\";'),('ru','mes