 была быть найдена, «$1» $2.\n\nПодобная ситуация обычно возникает при попытке перехода по устаревшей ссылке на историю изменения страницы, которая была удалена.\n\nЕсли дело не в этом, то скорее всего, вы обнаружили ошибку в программном обеспечении.\nПожалуйста, сообщите об этом [[Special:ListUsers/sysop|администратору]], указав URL.\";'),('ru','messages:missingarticle-rev','s:21:\"(версия № $1)\";'),('ru','messages:missingarticle-diff','s:26:\"(разность: $1, $2)\";'),('ru','messages:readonly_lag','s:223:\"База данных автоматически заблокирована от изменений на время, пока вторичный сервер БД не синхронизируется с первичным.\";'),('ru','messages:internalerror','s:33:\"Внутренняя ошибка\";'),('ru','messages:internalerror_info','s:37:\"Внутренняя ошибка: $1\";'),('ru','messages:fileappenderrorread','s:83:\"Не удалось прочитать «$1» во время дополнения.\";'),('ru','messages:fileappenderror','s:62:\"Не удалось присоединить «$1» к «$2».\";'),('ru','messages:filecopyerror','s:70:\"Невозможно скопировать файл «$1» в «$2».\";'),('ru','messages:filerenameerror','s:74:\"Невозможно переименовать файл «$1» в «$2».\";'),('ru','messages:filedeleteerror','s:52:\"Невозможно удалить файл «$1».\";'),('ru','messages:directorycreateerror','s:64:\"Невозможно создать директорию «$1».\";'),('ru','messages:filenotfound','s:48:\"Невозможно найти файл «$1».\";'),('ru','messages:fileexistserror','s:88:\"Невозможно записать в файл «$1»: файл существует.\";'),('ru','messages:unexpected','s:57:\"Неподходящее значение: «$1»=«$2».\";'),('ru','messages:formerror','s:75:\"Ошибка: невозможно передать данные формы\";'),('ru','messages:badarticleerror','s:103:\"Это действие не может быть выполнено на данной странице.\";'),('ru','messages:cannotdelete','s:147:\"Невозможно удалить страницу или файл «$1».\nВозможно, его уже удалил кто-то другой.\";'),('ru','messages:badtitle','s:41:\"Недопустимое название\";'),('ru','messages:badtitletext','s:316:\"Запрашиваемое название страницы неправильно, пусто, либо неправильно указано межъязыковое или интервики название. Возможно, в названии используются недопустимые символы.\";'),('ru','messages:perfcached','s:133:\"Следующие данные взяты из кеша и могут не учитывать последних изменений.\";'),('ru','messages:perfcachedts','s:116:\"Следующие данные взяты из кеша, последний раз он обновлялся в $1.\";'),('ru','messages:querypage-no-updates','s:184:\"Обновление этой страницы сейчас отключено.\nПредставленные здесь данные не будут актуализироваться.\";'),('ru','messages:wrong_wfQuery_params','s:123:\"Недопустимые параметры для функции wfQuery()<br />\nФункция: $1<br />\nЗапрос: $2\";'),('ru','messages:viewsource','s:16:\"Просмотр\";'),('ru','messages:viewsourcefor','s:23:\"Страница «$1»\";'),('ru','messages:actionthrottled','s:44:\"Ограничение по скорости\";'),('ru','messages:actionthrottledtext','s:361:\"В качестве меры борьбы со спамом, установлено ограничение на многократное применение данного действия в течение короткого промежутка времени. Пожалуйста, повторите попытку через несколько минут.\";'),('ru','messages:protectedpagetext','s:75:\"Эта страница закрыта для редактирования.\";'),('ru','messages:viewsourcetext','s:121:\"Вы можете просмотреть и скопировать исходный текст этой страницы:\";'),('ru','messages:protectedinterface','s:222:\"Эта страница содержит интерфейсное сообщение программного обеспечения. Во избежание вандализма её изменение запрещено.\";'),('ru','messages:editinginterface','s:491:\"\'\'\'Внимание.\'\'\' Вы редактируете страницу, содержащую текст интерфейса программного обеспечения.\nЕё изменение повлияет на внешний вид интерфейса для других пользователей.\nДля переводов лучше использовать [//translatewiki.net/wiki/Main_Page?setlang=ru translatewiki.net], проект по локализации MediaWiki.\";'),('ru','messages:sqlhidden','s:29:\"(SQL запрос скрыт)\";'),('ru','messages:cascadeprotected','s:289:\"Страница защищена от изменений, поскольку она включена в {{PLURAL:$1|следующую страницу, для которой|следующие страницы, для которых}} включена каскадная защита:\n$2\";'),('ru','messages:namespaceprotected','s:126:\"У вас нет разрешения редактировать страницы в пространстве имён «$1».\";'),('ru','messages:customcssprotected','s:198:\"У вас нет разрешения редактировать эту CSS-страницу, так как она содержит личные настройки другого участника.\";'),('ru','messages:customjsprotected','s:205:\"У вас нет разрешения редактировать эту JavaScript-страницу, так как она содержит личные настройки другого участника.\";'),('ru','messages:ns-specialprotected','s:105:\"Страницы пространства имён «{{ns:special}}» не могут правиться.\";'),('ru','messages:titleprotected','s:203:\"Создание страницы с таким заголовком было запрещено участником [[Участник:$1|$1]].\nУказана следующая причина: \'\'$2\'\'.\";'),('ru','messages:virus-badscanner','s:91:\"Ошибка настройки. Неизвестный сканер вирусов: \'\'$1\'\'\";'),('ru','messages:virus-scanfailed','s:49:\"ошибка сканирования (код $1)\";'),('ru','messages:virus-unknownscanner','s:42:\"неизвестный антивирус:\";'),('ru','messages:logouttext','s:567:\"\'\'\'Вы завершили сеанс работы.\'\'\'\n\nВы можете продолжить участие в {{grammar:genitive|{{SITENAME}}}} анонимно или [[Special:UserLogin|представиться заново]] под тем же или другим именем.\nНекоторые страницы могут продолжать отображаться в том виде, как будто вы всё ещё представлены системе. Для борьбы с этим явлением обновите кеш браузера.\";'),('ru','messages:welcomecreation','s:214:\"== Добро пожаловать, $1! ==\nВаша учётная запись создана.\nНе забудьте провести [[Special:Preferences|персональную настройку]] сайта.\";'),('ru','messages:yourname','s:26:\"Имя участника:\";'),('ru','messages:yourpassword','s:13:\"Пароль:\";'),('ru','messages:yourpasswordagain','s:43:\"Повторный набор пароля:\";'),('ru','messages:remembermypassword','s:144:\"Помнить мою учётную запись на этом компьютере (не более $1 {{PLURAL:$1|дня|дней|дней}})\";'),('ru','messages:securelogin-stick-https','s:76:\"Продолжить подключение по HTTPS после входа\";'),('ru','messages:yourdomainname','s:18:\"Ваш домен:\";'),('ru','messages:externaldberror','s:273:\"Произошла ошибка при аутентификации с помощью внешней базы данных, или у вас недостаточно прав для внесения изменений в свою внешнюю учётную запись.\";'),('ru','messages:login','s:41:\"Представиться системе\";'),('ru','messages:nav-login-createaccount','s:65:\"Представиться / зарегистрироваться\";'),('ru','messages:loginprompt','s:103:\"Вы должны разрешить «cookies», чтобы представиться системе.\";'),('ru','messages:userlogin','s:70:\"Представиться или зарегистрироваться\";'),('ru','messages:userloginnocreate','s:26:\"Представиться\";'),('ru','messages:logout','s:33:\"Завершение сеанса\";'),('ru','messages:userlogout','s:33:\"Завершение сеанса\";'),('ru','messages:notloggedin','s:51:\"Вы не представились системе\";'),('ru','messages:nologin','s:45:\"Нет учётной записи? \'\'\'$1\'\'\'.\";'),('ru','messages:nologinlink','s:42:\"Создать учётную запись\";'),('ru','messages:createaccount','s:64:\"Зарегистрировать нового участника\";'),('ru','messages:gotaccount','s:55:\"Вы уже зарегистрированы? \'\'\'$1\'\'\'.\";'),('ru','messages:gotaccountlink','s:26:\"Представьтесь\";'),('ru','messages:userlogin-resetlink','s:44:\"Забыли данные для входа?\";'),('ru','messages:createaccountmail','s:21:\"по эл. почте\";'),('ru','messages:createaccountreason','s:15:\"Причина:\";'),('ru','messages:badretype','s:65:\"Введённые вами пароли не совпадают.\";'),('ru','messages:userexists','s:137:\"Введённое имя участника уже используется.\nПожалуйста, выберите другое имя.\";'),('ru','messages:loginerror','s:54:\"Ошибка опознавания участника\";'),('ru','messages:createaccounterror','s:67:\"Невозможно создать учётную запись: $1\";'),('ru','messages:nocookiesnew','s:390:\"Участник зарегистрирован, но не представлен. {{SITENAME}} использует «cookies» для представления участников. У вас «cookies» запрещены. Пожалуйста, разрешите их, а затем представьтесь с вашим новым именем участника и паролем.\";'),('ru','messages:nocookieslogin','s:211:\"{{SITENAME}} использует «cookies» для представления участников. Вы их отключили. Пожалуйста, включите их и попробуйте снова.\";'),('ru','messages:nocookiesfornew','s:284:\"Учётная запись участника не была создан из-за невозможности проверить её источник. \nУбедитесь, что включены «куки», обновите страницу и попробуйте ещё раз.\";'),('ru','messages:noname','s:78:\"Вы не указали допустимого имени участника.\";'),('ru','messages:loginsuccesstitle','s:46:\"Опознание прошло успешно\";'),('ru','messages:loginsuccess','s:60:\"Теперь вы работаете под именем $1.\";'),('ru','messages:nosuchuser','s:320:\"Участника с именем $1 не существует.\nИмена участников чувствительны к регистру букв.\nПроверьте правильность написания имени или [[Special:UserLogin/signup|создайте новую учётную запись]].\";'),('ru','messages:nosuchusershort','s:114:\"Не существует участника с именем $1. Проверьте написание имени.\";'),('ru','messages:nouserspecified','s:59:\"Вы должны указать имя участника.\";'),('ru','messages:login-userblocked','s:101:\"Этот участник заблокирован. Вход в систему не разрешён.\";'),('ru','messages:wrongpassword','s:92:\"Введённый вами пароль неверен. Попробуйте ещё раз.\";'),('ru','messages:wrongpasswordempty','s:67:\"Пожалуйста, введите непустой пароль.\";'),('ru','messages:passwordtooshort','s:137:\"Пароль должен состоять не менее чем из $1 {{PLURAL:$1|символа|символов|символов}}.\";'),('ru','messages:password-name-match','s:101:\"Введённый пароль должен отличаться от имени участника.\";'),('ru','messages:password-login-forbidden','s:103:\"Использование этого имени участника и пароля запрещено.\";'),('ru','messages:mailmypassword','s:77:\"Выслать новый пароль по электронной почте\";'),('ru','messages:passwordremindertitle','s:88:\"Напоминание пароля участника {{grammar:genitive|{{SITENAME}}}}\";'),('ru','messages:passwordremindertext','s:888:\"Кто-то (вероятно, вы, с IP-адреса $1) запросил создать\nновый пароль для {{grammar:genitive|{{SITENAME}}}} ($4). Для участника $2\nсоздан временный пароль: $3. Если это был ваш запрос,\nвам следует представиться системе и выбрать новый пароль.\nВаш временный пароль будет действовать в течение $5 {{PLURAL:$5|дня|дней|дней}}.\n\nЕсли вы не посылали запроса на смену пароля, или если вы уже вспомнили свой пароль,\nи не желаете его менять, вы можете проигнорировать данное сообщение и\nпродолжить использовать свой старый пароль.\";'),('ru','messages:noemail','s:104:\"Для участника с именем $1 электронный адрес указан не был.\";'),('ru','messages:noemailcreate','s:108:\"Вам необходимо указать корректный адрес электронной почты\";'),('ru','messages:passwordsent','s:265:\"Новый пароль был выслан на адрес электронной почты, указанный для участника $1.\n\nПожалуйста, представьтесь системе заново после получения пароля.\";'),('ru','messages:blocked-mailpassword','s:183:\"Редактирование с вашего IP-адреса запрещено, поэтому заблокирована и функция восстановления пароля.\";'),('ru','messages:eauthentsent','s:455:\"На указанный адрес электронной почты отправлено письмо с запросом на подтверждение изменения адреса. В письме также описаны действия, которые нужно выполнить для подтверждения того, что этот адрес электронной почты действительно принадлежит вам.\";'),('ru','messages:throttled-mailpassword','s:431:\"Функция напоминания пароля уже использовалась в течение {{PLURAL:$1|последнего $1 часа|последних $1 часов|последних $1 часов}} .\nДля предотвращения злоупотреблений, разрешено запрашивать не более одного напоминания за $1 {{PLURAL:$1|час|часа|часов}}.\";'),('ru','messages:mailerror','s:51:\"Ошибка при отправке почты: $1\";'),('ru','messages:acct_creation_throttle_hit','s:611:\"За сутки с вашего IP-адреса {{PLURAL:$1|была создана $1 учётная запись участника|было создано $1 учётных записей участников|было создано $1 учётных записей участников}}, что является пределом для данного отрезка времени.\nТаким образом, пользователи, обладающие данным IP-адресом, в данный момент больше не могут создавать новых учётных записей.\";'),('ru','messages:emailauthenticated','s:67:\"Ваш почтовый адрес подтверждён $2 в $3.\";'),('ru','messages:emailnotauthenticated','s:191:\"Ваш адрес электронной почты ещё не был подтверждён, функции вики-движка по работе с эл. почтой отключены.\";'),('ru','messages:noemailprefs','s:167:\"Адрес электронной почты не был указан, функции вики-движка по работе с эл. почтой отключены.\";'),('ru','messages:emailconfirmlink','s:74:\"Подтвердить ваш адрес электронной почты\";'),('ru','messages:invalidemailaddress','s:266:\"Адрес электронной почты не может быть принят, так как он не соответствует формату.\nПожалуйста, введите корректный адрес или оставьте поле пустым.\";'),('ru','messages:accountcreated','s:42:\"Учётная запись создана\";'),('ru','messages:accountcreatedtext','s:65:\"Создана учётная запись участника $1.\";'),('ru','messages:createaccount-title','s:58:\"{{SITENAME}}: создание учётной записи\";'),('ru','messages:createaccount-text','s:414:\"Кто-то создал учётную запись «$2» на сервере проекта {{SITENAME}} ($4) с паролем «$3», указав ваш адрес электронной почты. Вам следует зайти и изменить пароль.\n\nПроигнорируйте данное сообщение, если учётная запись была создана по ошибке.\";'),('ru','messages:usernamehasherror','s:92:\"Имя участника не может содержать символ «решётки»\";'),('ru','messages:login-throttled','s:206:\"Вы сделали слишком много попыток представиться системе.\nПожалуйста, подождите, перед тем, как попробовать снова.\";'),('ru','messages:login-abort-generic','s:75:\"Неудачная попытка представиться системе\";'),('ru','messages:loginlanguagelabel','s:12:\"Язык: $1\";'),('ru','messages:suspicious-userlogout','s:236:\"Ваш запрос на завершение сеанса отклонён, так как он похож на запрос, отправленный некорректным браузером или кэширующим прокси.\";'),('ru','messages:php-mail-error-unknown','s:64:\"Неизвестная ошибка в PHP-функции mail()\";'),('ru','messages:resetpass','s:31:\"Изменение пароля\";'),('ru','messages:resetpass_announce','s:269:\"Вы представились с помощью временного пароля, полученного по электронной почте. Для завершения входа в систему, вы должны установить новый пароль.\";'),('ru','messages:resetpass_text','s:45:\"<!-- Добавьте сюда текст -->\";'),('ru','messages:resetpass_header','s:59:\"Изменение пароля учётной записи\";'),('ru','messages:oldpassword','s:26:\"Старый пароль:\";'),('ru','messages:newpassword','s:24:\"Новый пароль:\";'),('ru','messages:retypenew','s:54:\"Повторите ввод нового пароля:\";'),('ru','messages:resetpass_submit','s:63:\"Установить пароль и представиться\";'),('ru','messages:resetpass_success','s:110:\"Ваш пароль был успешно изменён! Выполняется вход в систему…\";'),('ru','messages:resetpass_forbidden','s:52:\"Пароль не может быть изменён\";'),('ru','messages:resetpass-no-info','s:157:\"Чтобы обращаться непосредственно к этой странице, вам следует представиться системе.\";'),('ru','messages:resetpass-submit-loggedin','s:29:\"Изменить пароль\";'),('ru','messages:resetpass-submit-cancel','s:12:\"Отмена\";'),('ru','messages:resetpass-wrong-oldpass','s:225:\"Неправильный временный или текущий пароль.\nВозможно, вы уже успешно изменили пароль, или запросили новый временный пароль.\";'),('ru','messages:resetpass-temp-password','s:32:\"Временный пароль:\";'),('ru','messages:passwordreset','s:23:\"Сброс пароля\";'),('ru','messages:passwordreset-text','s:168:\"Заполните эту форму, чтобы получить в письме напоминание о параметрах вашей учётной записи.\";'),('ru','messages:passwordreset-legend','s:41:\"Переустановить пароль\";'),('ru','messages:passwordreset-disabled','s:97:\"Функция переустановки пароля отключены на этой вики.\";'),('ru','messages:passwordreset-pretext','s:110:\"{{PLURAL:$1||введите один одну из частей данных, показанных ниже.}}\";'),('ru','messages:passwordreset-username','s:26:\"Имя участника:\";'),('ru','messages:passwordreset-domain','s:11:\"Домен:\";'),('ru','messages:passwordreset-email','s:45:\"Адрес электронной почты:\";'),('ru','messages:passwordreset-emailtitle','s:62:\"Сведения об учётной записи {{SITENAME}}\";'),('ru','messages:passwordreset-emailtext-ip','s:1003:\"Кто-то (возможно вы, с IP-адреса $1) запросил напоминание о вашей\nучётной записи в проекте {{SITENAME}} ($4).\n{{PLURAL:$3|Следующая учётная запись связана|Следующие учётные записи связаны}} с этим адресом электронной почты:\n\n$2\n\n{{PLURAL:$3|Этот временный пароль будет|Эти временные пароли будут}} действовать {{PLURAL:$5|$5 день|$5 дня|$5 дней}}.\nВы должны представиться системе и выберите новый пароль.\nЕсли вы не делали этого запроса, или вспомнили свой исходный пароль\nи не желаете его менять, вы можете проигнорировать это сообщение\nи продолжить использовать свой старый пароль.\";'),('ru','messages:passwordreset-emailtext-user','s:997:\"Участник $1 из проекта {{SITENAME}} запросил напоминание о вашей\nучётной записи в проекте {{SITENAME}} ($4).\n{{PLURAL:$3|Следующая учётная запись связана|Следующие учётные записи связаны}} с этим адресом электронной почты:\n\n$2\n\n{{PLURAL:$3|Этот временный пароль будет|Эти временные пароли будут}} действовать {{PLURAL:$5|$5 день|$5 дня|$5 дней}}.\nВы должны представиться системе и выберите новый пароль.\nЕсли вы не делали этого запроса, или вспомнили свой исходный пароль\nи не желаете его менять, вы можете проигнорировать это сообщение\nи продолжить использовать свой старый пароль.\";'),('ru','messages:passwordreset-emailelement','s:65:\"Имя участника: $1\nВременный пароль: $2\";'),('ru','messages:passwordreset-emailsent','s:92:\"По электронной почте было отправлено напоминание.\";'),('ru','messages:bold_sample','s:41:\"Полужирное начертание\";'),('ru','messages:bold_tip','s:41:\"Полужирное начертание\";'),('ru','messages:italic_sample','s:39:\"Курсивное начертание\";'),('ru','messages:italic_tip','s:39:\"Курсивное начертание\";'),('ru','messages:link_sample','s:31:\"Заголовок ссылки\";'),('ru','messages:link_tip','s:33:\"Внутренняя ссылка\";'),('ru','messages:extlink_sample','s:54:\"http://www.example.com заголовок ссылки\";'),('ru','messages:extlink_tip','s:73:\"Внешняя ссылка (помните о префиксе http:// )\";'),('ru','messages:headline_sample','s:29:\"Текст заголовка\";'),('ru','messages:headline_tip','s:38:\"Заголовок 2-го уровня\";'),('ru','messages:nowiki_sample','s:95:\"Вставьте сюда текст, который не нужно форматировать\";'),('ru','messages:nowiki_tip','s:62:\"Игнорировать вики-форматирование\";'),('ru','messages:image_tip','s:29:\"Встроенный файл\";'),('ru','messages:media_tip','s:37:\"Ссылка на медиа-файл\";'),('ru','messages:sig_tip','s:54:\"Ваша подпись и момент времени\";'),('ru','messages:hr_tip','s:80:\"Горизонтальная линия (не используйте часто)\";'),('ru','messages:summary','s:36:\"Описание изменений:\";'),('ru','messages:subject','s:28:\"Тема/заголовок:\";'),('ru','messages:minoredit','s:29:\"Малое изменение\";'),('ru','messages:watchthis','s:77:\"Включить эту страницу в список наблюдения\";'),('ru','messages:savearticle','s:33:\"Записать страницу\";'),('ru','messages:preview','s:24:\"Предпросмотр\";'),('ru','messages:showpreview','s:47:\"Предварительный просмотр\";'),('ru','messages:showlivepreview','s:39:\"Быстрый предпросмотр\";'),('ru','messages:showdiff','s:37:\"Внесённые изменения\";'),('ru','messages:anoneditwarning','s:187:\"\'\'\'Внимание.\'\'\' Вы не представились системе.\nВаш IP-адрес будет записан в историю изменений этой страницы.\";'),('ru','messages:anonpreviewwarning','s:194:\"\'\'Вы не представились системе. Сохранение приведёт к записи вашего IP-адреса в историю изменений страницы.\'\'\";'),('ru','messages:missingsummary','s:275:\"\'\'\'Напоминание.\'\'\' Вы не дали краткого описания изменений. При повторном нажатии на кнопку «{{int:savearticle}}», ваши изменения будут сохранены без комментария.\";'),('ru','messages:missingcommenttext','s:74:\"Пожалуйста, введите ниже ваше сообщение.\";'),('ru','messages:missingcommentheader','s:285:\"\'\'\'Напоминание.\'\'\' Вы не указали тему/заголовок для этого комментария.\nПри повторном нажатии на кнопку «{{int:savearticle}}», ваша правка будет записана без заголовка.\";'),('ru','messages:summary-preview','s:28:\"Описание будет:\";'),('ru','messages:subject-preview','s:30:\"Заголовок будет:\";'),('ru','messages:blockedtitle','s:41:\"Участник заблокирован\";'),('ru','messages:blockedtext','s:1214:\"\'\'\'Ваша учётная запись или IP-адрес заблокированы.\'\'\'\n\nБлокировка произведена администратором $1.\nУказана следующая причина: \'\'«$2»\'\'.\n\n* Начало блокировки: $8\n* Окончание блокировки: $6\n* Был заблокирован: $7\n\nВы можете отправить письмо участнику $1 или любому другому [[{{MediaWiki:Grouppage-sysop}}|администратору]], чтобы обсудить блокировку.\nОбратите внимание, что вы не сможете отправить письмо администратору, если вы не зарегистрированы и не подтвердили свой адрес электронной почты в [[Special:Preferences|личных настройках]], а также если вам было запрещено отправлять письма при блокировке.\nВаш IP-адрес — $3, идентификатор блокировки — #$5.\nПожалуйста, указывайте эти данные в ваших обращениях.\";'),('ru','messages:autoblockedtext','s:1366:\"Ваш IP-адрес автоматически заблокирован в связи с тем, что он ранее использовался кем-то из заблокированных участников. Заблокировавший его администратор ($1) указал следующую причину блокировки:\n\n:«$2»\n\n* Начало блокировки: $8\n* Окончание блокировки: $6\n* Был заблокирован: $7\n\nВы можете отправить письмо участнику $1 или любому другому [[{{MediaWiki:Grouppage-sysop}}|администратору]], чтобы обсудить блокировку.\n\nОбратите внимание, что вы не сможете отправить письмо администратору, если вы не зарегистрированы в проекте и не подтвердили свой адрес электронной почты в [[Special:Preferences|личных настройках]], а также если вам было запрещено отправлять письма при блокировке.\n\nВаш IP-адрес — $3, идентификатор блокировки — #$5.\nПожалуйста, указывайте эти данные в ваших обращениях.\";'),('ru','messages:blockednoreason','s:34:\"причина не указана\";'),('ru','messages:blockedoriginalsource','s:59:\"Ниже показан текст страницы «$1».\";'),('ru','messages:blockededitsource','s:95:\"Ниже показан текст \'\'\'ваших изменений\'\'\' страницы «$1».\";'),('ru','messages:whitelistedittitle','s:67:\"Для изменения требуется авторизация\";'),('ru','messages:whitelistedittext','s:62:\"Вы должны $1 для изменения страниц.\";'),('ru','messages:confirmedittext','s:313:\"Вы должны подтвердить ваш адрес электронной почты перед правкой страниц.\nПожалуйста, введите и подтвердите ваш адрес электронной почты на [[Special:Preferences|странице настроек]].\";'),('ru','messages:nosuchsectiontitle','s:44:\"Невозможно найти раздел\";'),('ru','messages:nosuchsectiontext','s:229:\"Вы пытаетесь редактировать несуществующий раздел.\nВозможно, он был перемещён или удалён, пока вы просматривали эту страницу.\";'),('ru','messages:loginreqtitle','s:41:\"Требуется авторизация\";'),('ru','messages:loginreqlink','s:26:\"представиться\";'),('ru','messages:loginreqpagetext','s:86:\"Вы должны $1, чтобы просмотреть другие страницы.\";'),('ru','messages:accmailtitle','s:26:\"Пароль выслан.\";'),('ru','messages:accmailtext','s:288:\"Пароль для участника [[User talk:$1|$1]], созданный из случайных символов, выслан на адрес $2.\n\nПосле регистрации в системе вы сможете \'\'[[Special:ChangePassword|изменить пароль]]\'\'.\";'),('ru','messages:newarticle','s:12:\"(Новая)\";'),('ru','messages:newarticletext','s:465:\"Вы перешли по ссылке на страницу, которой пока не существует.\nЧтобы её создать, наберите текст в окне, расположенном ниже (подробнее см. [[{{MediaWiki:Helppage}}|справочную страницу]]).\nЕсли вы оказались здесь по ошибке, просто нажмите кнопку \'\'\'назад\'\'\' вашего браузера.\";'),('ru','messages:anontalkpagetext','s:916:\"----\'\'Эта страница обсуждения принадлежит анонимному участнику, который ещё не создал учётной записи, или не использует её.\nПоэтому для идентификации используется цифровой IP-адрес.\nЭтот же адрес может соответствовать нескольким другим участникам.\nЕсли вы анонимный участник и полагаете, что получили сообщения, адресованные не вам, пожалуйста, [[Special:UserLogin/signup|создайте учётную запись]] или [[Special:UserLogin|представьтесь системе]], чтобы впредь избежать возможной путаницы с другими анонимными участниками.\'\'\";'),('ru','messages:noarticletext','s:531:\"В настоящий момент текст на данной странице отсутствует.\nВы можете [[Special:Search/{{PAGENAME}}|найти упоминание данного названия]] в других статьях,\n<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} найти соответствующие записи журналов],\nили \'\'\'[{{fullurl:{{FULLPAGENAME}}|action=edit}} создать страницу с таким названием]\'\'\'</span>.\";'),('ru','messages:noarticletext-nopermission','s:396:\"В настоящее время на этой странице нет текста.\nВы можете [[Special:Search/{{PAGENAME}}|найти упоминание данного названия]] в других статьях,\nили <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} найти соответствующие записи журналов].</span>\";'),('ru','messages:userpage-userdoesnotexist','s:216:\"Учётной записи «<nowiki>$1</nowiki>» не существует. Убедитесь, что вы действительно желаете создать или изменить эту страницу.\";'),('ru','messages:userpage-userdoesnotexist-view','s:92:\"Не зарегистрировано учётной записи участника «$1».\";'),('ru','messages:blocked-notice-logextract','s:182:\"Этот участник в данный момент заблокирован.\nНиже приведена последняя запись из журнала блокировок:\";'),('ru','messages:clearyourcache','s:826:\"\'\'\'Замечание.\'\'\' Возможно, после сохранения вам придётся очистить кеш своего браузера, чтобы увидеть изменения.\n* \'\'\'Firefox / Safari.\'\'\' Удерживая клавишу \'\'Shift\'\' нажмите на панели инструментов \'\'Обновить\'\', или нажмите \'\'Ctrl-F5\'\' или \'\'Ctrl-R\'\' (\'\'Command-R\'\' на Mac)\n* \'\'\'Google Chrome.\'\'\' Нажмите \'\'Ctrl-Shift-R\'\' (\'\'Command-Shift-R\'\' на Mac)\n* \'\'\'Internet Explorer.\'\'\' Удерживая \'\'Ctrl\'\' нажмите \'\'Обновить\'\', или нажмите \'\'Ctrl-F5\'\'\n* \'\'\'Konqueror.\'\'\' Нажмите \'\'Обновить\'\' или \'\'F5\'\'\n* \'\'\'Opera.\'\'\' Выберите очистку кеша в меню \'\'Инструменты → Настройки\'\'\";'),('ru','messages:usercssyoucanpreview','s:174:\"\'\'\'Подсказка.\'\'\' Нажмите кнопку «{{int:showpreview}}», чтобы проверить ваш новый CSS-файл перед сохранением.\";'),('ru','messages:userjsyoucanpreview','s:173:\"\'\'\'Подсказка.\'\'\' Нажмите кнопку «{{int:showpreview}}», чтобы проверить ваш новый JS-файл перед сохранением.\";'),('ru','messages:usercsspreview','s:160:\"\'\'\'Помните, что это только предварительный просмотр вашего CSS-файла, он ещё не сохранён!\'\'\'\";'),('ru','messages:userjspreview','s:167:\"\'\'\'Помните, что это только предварительный просмотр вашего javascript-файла, он ещё не сохранён!\'\'\'\";'),('ru','messages:sitecsspreview','s:159:\"\'\'\'Помните, что вы только предварительно просматриваете этот CSS.\'\'\'\n\'\'\'Он ещё не сохранён!\'\'\'\";'),('ru','messages:sitejspreview','s:173:\"\'\'\'Помните, что вы только предварительно просматриваете этот JavaScript-код.\'\'\'\n\'\'\'Он ещё не сохранён!\'\'\'\";'),('ru','messages:userinvalidcssjstitle','s:375:\"\'\'\'Внимание:\'\'\' тема оформления «$1» не найдена. Помните, что пользовательские страницы .css и .js должны иметь название, состоящее только из строчных букв, например «{{ns:user}}:Некто/vector.css», а не «{{ns:user}}:Некто/Vector.css».\";'),('ru','messages:updated','s:20:\"(Обновлена)\";'),('ru','messages:note','s:27:\"\'\'\'Примечание:\'\'\'\";'),('ru','messages:previewnote','s:113:\"\'\'\'Это только предварительный просмотр, текст ещё не записан!\'\'\'\";'),('ru','messages:previewconflict','s:243:\"Этот предварительный просмотр отражает текст в верхнем окне редактирования так, как он будет выглядеть, если вы решите записать его.\";'),('ru','messages:session_fail_preview','s:406:\"\'\'\'К сожалению, сервер не смог обработать вашу правку из-за потери идентификатора сессии.\nПожалуйста, попробуйте ещё раз.\nЕсли эта ошибка повторится, попробуйте [[Special:UserLogout|завершить сеанс]] и заново представиться системе.\'\'\'\";'),('ru','messages:session_fail_preview_html','s:741:\"\'\'\'К сожалению, сервер не смог обработать вашу правку из-за потери данных сессии.\'\'\'\n\n\'\'Так как {{SITENAME}} разрешает использовать чистый HTML, предварительный просмотр отключён в качестве меры предотвращения JavaScript-атак.\'\'\n\n\'\'\'Если это добросовестная попытка редактирования, пожалуйста, попробуйте ещё раз.\nЕсли не получается повторная правка, попробуйте [[Special:UserLogout|завершить сеанс]] работы и заново представиться.\'\'\'\";'),('ru','messages:token_suffix_mismatch','s:526:\"\'\'\'Ваша правка была отклонена, так как ваша программа неправильно обрабатывает знаки пунктуации\nв окне редактирования. Правка была отменена для предотвращения искажения текста статьи.\nПодобные проблемы могут возникать при использовании анонимизирующих веб-прокси, содержащих ошибки.\'\'\'\";'),('ru','messages:edit_form_incomplete','s:251:\"\'\'\'Некоторые части формы редактирования не достигли сервера. Внимательно проверьте, что ваши правки не повреждены, и попробуйте ещё раз.\'\'\'\";'),('ru','messages:editing','s:32:\"Редактирование: $1\";'),('ru','messages:editingsection','s:47:\"Редактирование: $1 (раздел)\";'),('ru','messages:editingcomment','s:57:\"Редактирование $1 (новый раздел)\";'),('ru','messages:editconflict','s:49:\"Конфликт редактирования: $1\";'),('ru','messages:explainconflict','s:554:\"Пока вы редактировали эту страницу, кто-то внёс в неё изменения.\nВ верхнем окне для редактирования вы видите текущий текст страницы.\nВ нижнем окне находится ваш вариант.\nПеренесите сделанные вами изменения из нижнего окна в верхнее.\nПри нажатии на кнопку «{{int:savearticle}}» будет сохранён текст верхнего окна.\";'),('ru','messages:yourtext','s:17:\"Ваш текст\";'),('ru','messages:storedversion','s:35:\"Сохранённая версия\";'),('ru','messages:nonunicodebrowser','s:289:\"\'\'\'ПРЕДУПРЕЖДЕНИЕ: Ваш браузер не поддерживает кодировку Юникод. При редактировании статей все не-ASCII символы будут заменены на свои шестнадцатеричные коды.\'\'\'\";'),('ru','messages:editingold','s:271:\"\'\'\'Предупреждение. Вы редактируете устаревшую версию данной страницы.\'\'\'\nПосле сохранения будут потеряны изменения, сделанные в последующих версиях.\";'),('ru','messages:yourdiff','s:16:\"Различия\";'),('ru','messages:copyrightwarning','s:913:\"Обратите внимание, что все добавления и изменения текста статьи рассматриваются, как выпущенные на условиях лицензии $2 (см. $1).\nЕсли вы не хотите, чтобы ваши тексты свободно распространялись и редактировались любым желающим, не помещайте их сюда.<br />\nВы также подтверждаете, что являетесь автором вносимых дополнений, или скопировали их из\nисточника, допускающего свободное распространение и изменение своего содержимого.<br />\n\'\'\'НЕ РАЗМЕЩАЙТЕ БЕЗ РАЗРЕШЕНИЯ МАТЕРИАЛЫ, ОХРАНЯЕМЫЕ АВТОРСКИМ ПРАВОМ!\'\'\'\";'),('ru','messages:copyrightwarning2','s:817:\"Пожалуйста, учтите, что любой ваш вклад в проект «{{SITENAME}}» может быть отредактирован или удалён другими участниками.\nЕсли вы не хотите, чтобы кто-либо изменял ваши тексты, не помещайте их сюда.<br />\nВы также подтверждаете, что являетесь автором вносимых дополнений, или скопировали их из источника, допускающего свободное распространение и изменение своего содержимого (см. $1).\n\'\'\'НЕ РАЗМЕЩАЙТЕ БЕЗ РАЗРЕШЕНИЯ ОХРАНЯЕМЫЕ АВТОРСКИМ ПРАВОМ МАТЕРИАЛЫ!\'\'\'\";'),('ru','messages:longpageerror','s:260:\"\'\'\'ОШИБКА: записываемый вами текст имеет размер $1 килобайт, что больше, чем установленный предел $2 килобайт. Страница не может быть сохранена.\'\'\'\";'),('ru','messages:readonlywarning','s:561:\"\'\'\'ПРЕДУПРЕЖДЕНИЕ. База данных заблокирована в связи с процедурами обслуживания, поэтому вы не можете записать ваши изменения прямо сейчас.\nВозможно, вам следует сохранить текст в файл, чтобы воспользоваться этим текстом позже.\'\'\'\n\nАдминистратор, заблокировавший базу данных, оставил следующее объяснение: $1\";'),('ru','messages:protectedpagewarning','s:334:\"\'\'\'Предупреждение. Эта страница защищена от изменений, её могут редактировать только участники с полномочиями администраторов.\'\'\'\nНиже для справки приведена последняя запись журнала:\";'),('ru','messages:semiprotectedpagewarning','s:287:\"\'\'\'Замечание.\'\'\' Эта страница была защищена; редактировать её могут только зарегистрированные участники.\nНиже для справки приведена последняя запись журнала:\";'),('ru','messages:cascadeprotectedwarning','s:413:\"\'\'\'Предупреждение:\'\'\' Данную страницу могут редактировать только участники группы «Администраторы», поскольку она включена {{PLURAL:$1|в следующую страницу, для которой|в следующие страницы, для которых}} включена каскадная защита:\";'),('ru','messages:titleprotectedwarning','s:365:\"\'\'\'Предупреждение.  Эта страница защищена от изменений, её могут редактировать только участники с [[Special:ListGroupRights|соответствующими полномочиями]].\'\'\'\nНиже для справки приведена последняя запись журнала:\";'),('ru','messages:templatesused','s:152:\"{{PLURAL:$1|Шаблон, использованный|Шаблоны, использованные}} на текущей версии страницы:\";'),('ru','messages:templatesusedpreview','s:153:\"{{PLURAL:$1|Шаблон, используемый|Шаблоны, используемые}} в предпросматриваемой странице:\";'),('ru','messages:templatesusedsection','s:125:\"{{PLURAL:$1|Шаблон, используемый|Шаблоны, использованные}} в этом разделе:\";'),('ru','messages:template-protected','s:18:\"(защищено)\";'),('ru','messages:template-semiprotected','s:35:\"(частично защищено)\";'),('ru','messages:hiddencategories','s:169:\"Эта страница относится к $1 {{PLURAL:$1|скрытой категории|скрытым категориям|скрытым категориям}}:\";'),('ru','messages:edittools','s:176:\"<!-- Расположенный здесь текст будет показываться под формой редактирования и формой загрузки. -->\";'),('ru','messages:nocreatetitle','s:52:\"Создание страниц ограничено\";'),('ru','messages:nocreatetext','s:363:\"На этом сайте ограничена возможность создания новых страниц.\nВы можете вернуться назад и отредактировать существующую страницу, [[Special:UserLogin|представиться системе или создать новую учётную запись]].\";'),('ru','messages:nocreate-loggedin','s:85:\"У вас нет разрешения создавать новые страницы.\";'),('ru','messages:sectioneditnotsupported-title','s:79:\"Редактирование разделов не поддерживается\";'),('ru','messages:sectioneditnotsupported-text','s:110:\"На этой странице не поддерживается редактирование разделов\";'),('ru','messages:permissionserrors','s:36:\"Ошибки прав доступа\";'),('ru','messages:permissionserrorstext','s:167:\"У вас нет прав на выполнение этой операции по {{PLURAL:$1|следующей причине|следующим причинам}}:\";'),('ru','messages:permissionserrorstext-withaction','s:162:\"У вас нет разрешения на действие «\'\'\'$2\'\'\'» по {{PLURAL:$1|следующей причине|следующим причинам}}:\";'),('ru','messages:recreate-moveddeleted-warn','s:372:\"\'\'\'Внимание. Вы пытаетесь воссоздать страницу, которая ранее удалялась.\'\'\'\n\nПроверьте, действительно ли вам нужно воссоздавать эту страницу.\nНиже приведены журналы удалений и переименований этой страницы.\";'),('ru','messages:moveddeleted-notice','s:212:\"Эта страница была удалена.\nДля справки ниже показаны соответствующие записи из журналов удалений и переименований.\";'),('ru','messages:log-fulllog','s:50:\"Просмотреть журнал целиком\";'),('ru','messages:edit-hook-aborted','s:155:\"Правка отменена процедурой-перехватчиком.\nДополнительных разъяснений не приведено.\";'),('ru','messages:edit-gone-missing','s:105:\"Невозможно обновить страницу.\nВероятно, она была удалена.\";'),('ru','messages:edit-conflict','s:30:\"Конфликт правок.\";'),('ru','messages:edit-no-change','s:129:\"Ваша правка была отклонена, так как в тексте не было сделано изменений.\";'),('ru','messages:edit-already-exists','s:100:\"Невозможно создать новую страницу.\nОна