раницы не существует.\nОна могла быть удалена или переименована.\nПопробуйте [[Special:Search|найти в вики]] похожие страницы.\";'),('ru','messages:rev-deleted-comment','s:46:\"(описание правки удалено)\";'),('ru','messages:rev-deleted-user','s:34:\"(имя автора стёрто)\";'),('ru','messages:rev-deleted-event','s:29:\"(запись удалена)\";'),('ru','messages:rev-deleted-user-contribs','s:128:\"[имя участника или IP-адрес удалены — правка скрыта со страницы вклада]\";'),('ru','messages:rev-deleted-text-permission','s:212:\"Эта версия страницы была \'\'\'удалена\'\'\'.\nВозможно, объяснения даны в [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} журнале удалений].\";'),('ru','messages:rev-deleted-text-unhide','s:299:\"Эта версия страницы была \'\'\'удалена\'\'\'.\nОбъяснения приведены в [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} журнале удалений].\nПри желании вы можете [$1 просмотреть данную версию].\";'),('ru','messages:rev-suppressed-text-unhide','s:299:\"Эта версия страницы была \'\'\'скрыта\'\'\'.\nОбъяснения приведены в [{{fullurl:{{#Special:Log}}/suppress|page={{FULLPAGENAMEE}}}} журнале сокрытий].\nПри желании вы можете [$1 просмотреть данную версию].\";'),('ru','messages:rev-deleted-text-view','s:268:\"Эта версия страницы была \'\'\'удалена\'\'\'.\nВы можете просмотреть её. Объяснения удаления приведены в [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} журнале удалений].\";'),('ru','messages:rev-suppressed-text-view','s:268:\"Эта версия страницы была \'\'\'скрыта\'\'\'.\nВы можете просмотреть её. Объяснения удаления приведены в [{{fullurl:{{#Special:Log}}/suppress|page={{FULLPAGENAMEE}}}} журнале сокрытий].\";'),('ru','messages:rev-deleted-no-diff','s:330:\"Вы не можете просмотреть эту разницу версий, так как одна из версий страницы была \'\'\'удалена\'\'\'.\nВозможно, подробности можно найти в [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} журнале удалений].\";'),('ru','messages:rev-suppressed-no-diff','s:185:\