ой предполагается хранить загружаемые файлы.\";'),('ru','messages:uploaderror','s:40:\"Ошибка загрузки файла\";'),('ru','messages:upload-recreate-warning','s:234:\"\'\'\'Внимание. Файл с таким именем был удален или переименован.\'\'\n\nЖурнал удалений и переименований для этой странице приведён ниже:\";'),('ru','messages:uploadtext','s:1324:\"Воспользуйтесь этой формой для загрузки файлов на сервер.\nЧтобы просмотреть ранее загруженные файлы, обратитесь к [[Special:FileList|списку загруженных файлов]]. Загрузка файлов также записывается в [[Special:Log/upload|журнал загрузок]], данные об удалённых файлах можно найти в [[Special:Log/delete|журнале удалений]].\n\nДля включения файла в статью вы можете использовать строки вида:\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></tt>\'\'\' для вставки полной версии файла;\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|описание]]</nowiki></tt>\'\'\' для вставки слева от текста уменьшенной до 200 пикселей по ширине версии файла с выводом под ним указанного описания;\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></tt>\'\'\' для вставки ссылки на файл, без отображения его содержимого на странице.\";'),('ru','messages:upload-permitted','s:49:\"Разрешённые типы файлов: $1.\";'),('ru','messages:upload-preferred','s:59:\"Предпочтительные типы файлов: $1.\";'),('ru','messages:upload-prohibited','s:49:\"Запрещённые типы файлов: $1.\";'),('ru','messages:uploadlog','s:29:\"журнал загрузок\";'),('ru','messages:uploadlogpage','s:29:\"Журнал загрузок\";'),('ru','messages:uploadlogpagetext','s:297:\"Ниже представлен список последних загрузок файлов.\nСм. также [[Special:NewFiles|галерею новых файлов]], где сведения о новых загрузках представлены в более наглядном виде.\";'),('ru','messages:filename','s:17:\"Имя файла\";'),('ru','messages:filedesc','s:31:\"Краткое описание\";'),('ru','messages:fileuploadsummary','s:32:\"Краткое описание:\";'),('ru','messages:f