rror','s:72:\"Этот файл не прошёл процедуру проверки.\";'),('ru','messages:hookaborted','s:126:\"Предлагаемое вами изменение было отменено в обработчике расширения.\";'),('ru','messages:illegal-filename','s:43:\"Недопустимое имя файла.\";'),('ru','messages:overwrite','s:79:\"Не допускается замена существующего файла.\";'),('ru','messages:unknown-error','s:36:\"Неизвестная ошибка.\";'),('ru','messages:tmp-create-error','s:64:\"Невозможно создать временный файл.\";'),('ru','messages:tmp-write-error','s:59:\"Ошибка записи во временный файл.\";'),('ru','messages:large-file','s:212:\"Рекомендуется использовать файлы, размер которых не превышает $1 байт (размер загруженного файла составляет $2 байт).\";'),('ru','messages:largefileserver','s:89:\"Размер файла превышает максимально разрешённый.\";'),('ru','messages:emptyfile','s:311:\"Загруженный вами файл вероятно пустой. Возможно, это произошло из-за ошибки при наборе имени файла. Пожалуйста, проверьте, действительно ли вы хотите загрузить этот файл.\";'),('ru','messages:windows-nonascii-filename','s:146:\"Эта вики не поддерживает имена файлов с символами, отсутствующими в таблице ASCII.\";'),('ru','messages:fileexists','s:220:\"Файл с этим именем уже существует, пожалуйста, проверьте \'\'\'<tt>[[:$1]]</tt>\'\'\', если вы не уверены, что хотите заменить его.\n[[$1|thumb]]\";'),('ru','messages:filepageexists','s:422:\"Страница описания для этого файла уже создана как \'\'\'<tt>[[:$1]]</tt>\'\'\', но файла с таким именем сейчас нет.\nВведённое описание не появится на странице описания файла.\nЧтобы добавить новое описание, вам придётся изменить его вручную.\n[[$1|thumb]]\";'),('ru','messages:fileexists-extension','s:274:\"Существует файл с похожим именем: [[$2|thumb]]\n* Имя загруженного файла: \'\'\'<tt>[[:$1]]</tt>\'\'\'\n* Имя существующего файла: \'\'\'<tt>[[:$2]]</tt>\'\'\'\nПожалуйста, выберите другое имя.\";'),('ru','messages:fileexists-thumbnail-yes','s:377:\"Файл, вероятно, является уменьшенной копией (миниатюрой). [[$1|thumb]]\nПожалуйста, проверьте файл \'\'\'<tt>[[:$1]]</tt>\'\'\'.\nЕсли указанный файл является тем же изображением, не стоит загружать отдельно его уменьшенную копию.\";'),('ru','messages:file-thumbnail-no','s:365:\"Название файла начинается с \'\'\'<tt>$1</tt>\'\'\'.\nВероятно, это уменьшенная копия изображения \'\'(миниатюра)\'\'.\nЕсли у вас есть данное изображение в полном размере, пожалуйста, загрузите его или измените имя файла.\";'),('ru','messages:fileexists-forbidden','s:338:\"Файл с этим именем уже существует и не может быть перезаписан.\nЕсли всё равно хотите загрузить данный файл, пожалуйста, вернитесь назад и загрузите его под другим именем. [[File:$1|thumb|center|$1]]\";'),('ru','messages:fileexists-shared-forbidden','s:308:\"Файл с этим именем уже существует в общем хранилище файлов.\nЕсли вы всё-таки хотите загрузить этот файл, пожалуйста, вернитесь назад и измените имя файла. [[File:$1|thumb|center|$1]]\";'),('ru','messages:file-exists-duplicate','s:134:\"Этот файл является дубликатом {{PLURAL:$1|следующего файла|следующих файлов}}:\";'),('ru','messages:file-deleted-duplicate','s:214:\"Подобный файл ([[:$1]]) уже удалялся. Пожалуйста, ознакомьтесь с историей удаления файла, прежде чем загружать его снова.\";'),('ru','messages:uploadwarning','s:28:\"Предупреждение\";'),('ru','messages:uploadwarning-text','s:143:\"Пожалуйста, измените представленное ниже описание файла и попробуйте ещё раз.\";'),('ru','messages:savefile','s:25:\"Записать файл\";'),('ru','messages:uploadedimage','s:27:\"загрузил «[[$1]]»\";'),('ru','messages:overwroteimage','s:53:\"загружена новая версия «[[$1]]»\";'),('ru','messages:uploaddisabled','s:35:\"Загрузка запрещена\";'),('ru','messages:copyuploaddisabled','s:45:\"Загрузка по URL отключена.\";'),('ru','messages:uploadfromurl-queued','s:65:\"Ваша загрузка поставлена в очередь.\";'),('ru','messages:uploaddisabledtext','s:49:\"Загрузка файлов отключена.\";'),('ru','messages:php-uploaddisabledtext','s:166:\"Загрузка файлов