 см. $PAGETITLE_URL для просмотра текущей версии.\n\n$NEWPAGE\n\nКраткое описание изменения: $PAGESUMMARY $PAGEMINOREDIT\n\nОбратиться к изменившему:\nэл. почта: $PAGEEDITOR_EMAIL\nвики: $PAGEEDITOR_WIKI\n\nЕсли вы не посетите эту страницу, то в случае её дальнейших изменений уведомлений больше не будет.\nВы можете также отключить опцию уведомления для всех страниц в вашем списке наблюдения.\n\n             Система оповещения {{grammar:genitive|{{SITENAME}}}}\n\n--\nИзменение настройки уведомлений\n{{canonicalurl:{{#special:Preferences}}}}\n\nИзменение настройки вашего списка наблюдения\n{{canonicalurl:{{#special:EditWatchlist}}}}\n\nУдалить страницы из вашего списка наблюдения\n$UNWATCHURL\n\nОбратная связь и помощь\n{{canonicalurl:{{MediaWiki:Helppage}}}}\";'),('ru','messages:deletepage','s:31:\"Удалить страницу\";'),('ru','messages:confirm','s:22:\"Подтвердить\";'),('ru','messages:excontent','s:28:\"содержимое: «$1»\";'),('ru','messages:excontentauthor','s:109:\"содержимое: «$1» (единственным автором был [[Special:Contributions/$2|$2]])\";'),('ru','messages:exbeforeblank','s:48:\"содержимое до очистки: «$1»\";'),('ru','messages:exblank','s:36:\"страница была пуста\";'),('ru','messages:delete-confirm','s:23:\"$1 — удаление\";'),('ru','messages:delete-legend','s:16:\"Удаление\";'),('ru','messages:historywarning','s:248:\"\'\'\'Предупреждение\'\'\'. Страница, которую вы собираетесь удалить, имеет историю изменений приблизительно из $1 {{PLURAL:$1|версии|версий|версий}}:\";'),('ru','messages:confirmdeletetext','s:522:\"Вы запросили полное удаление страницы (или изображения) и всей её истории изменений из базы данных.\nПожалуйста, подтвердите, что вы действительно желаете это сделать, понимаете последствия своих действий,\nи делаете это в соответствии с правилами, изложенными в разделе [[{{MediaWiki:Policy-url}}]].\";'),('ru','messages:actioncomplete','s:35:\"Действие выполнено\";'),('ru','messages:actionfailed','s:40:\"Действие не выполнено\";'),('ru','messages:deletedtext','s:116:\"«$1» была удалена.\nСм. $2 для просмотра списка последних удалений.\";'),('ru','messages:deletedarticle','s:23:\"удалил «[[$1]]»\";'),('ru','messages:suppressedarticle','s:21:\"скрыл «[[$1]]»\";'),('ru','messages:dellogpage','s:29:\"Журнал удалений\";'),('ru','messages:dellogpagetext','s:75:\"Ниже приведён журнал последних удалений.\";'),('ru','messages:deletionlog','s:29:\"журнал удалений\";'),('ru','messages:reverted','s:45:\"Откачено к ранней версии\";'),('ru','messages:deletecomment','s:15:\"Причина:\";'),('ru','messages:deleteotherreason','s:49:\"Другая причина/дополнение:\";'),('ru','messages:deletereasonotherlist','s:27:\"Другая причина\";'),('ru','messages:deletereason-dropdown','s:156:\"* Типовые причины удаления\n** вандализм\n** по запросу автора\n** нарушение авторских прав\";'),('ru','messages:delete-edit-reasonlist','s:40:\"Править список причин\";'),('ru','messages:delete-toobig','s:312:\"У этой страницы очень длинная история изменений, более $1 {{PLURAL:$1|версии|версий|версий}}.\nУдаление таких страниц было запрещено во избежание нарушений в работе сайта {{SITENAME}}.\";'),('ru','messages:delete-warning-toobig','s:362:\"У этой страницы очень длинная история изменений, более $1 {{PLURAL:$1|версии|версий|версий}}.\nЕё удаление может привести к нарушению нормальной работы базы данных сайта {{SITENAME}};\nдействуйте с осторожностью.\";'),('ru','messages:rollback','s:35:\"Откатить изменения\";'),('ru','messages:rollback_short','s:10:\"Откат\";'),('ru','messages:rollbacklink','s:16:\"откатить\";'),('ru','messages:rollbackfailed','s:53:\"Ошибка при совершении отката\";'),('ru','messages:cantrollback','s:201:\"Невозможно откатить изменения. Последний, кто вносил изменения, является единственным автором этой страницы.\";'),('ru','messages:alreadyrolled','s:513:\"Невозможно откатить последние изменения [[:$1]], сделанные [[User:$2|$2]] ([[User talk:$2|Обсуждение]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]);\nкто-т