"$1 ссылки для изображений\";'),('ru','messages:whatlinkshere-filters','s:14:\"Фильтры\";'),('ru','messages:autoblockid','s:32:\"Автоблокировка #$1\";'),('ru','messages:block','s:39:\"Блокировка участника\";'),('ru','messages:unblock','s:45:\"Разблокировка участника\";'),('ru','messages:blockip','s:26:\"Заблокировать\";'),('ru','messages:blockip-title','s:43:\"Блокирование участника\";'),('ru','messages:blockip-legend','s:39:\"Блокировка участника\";'),('ru','messages:blockiptext','s:560:\"Используйте форму ниже, чтобы заблокировать возможность записи с определённого IP-адреса.\nЭто может быть сделано только для предотвращения вандализма и только в соответствии с [[{{MediaWiki:Policy-url}}|правилами]].\nНиже укажите конкретную причину (к примеру, процитируйте некоторые страницы с признаками вандализма).\";'),('ru','messages:ipadressorusername','s:47:\"IP-адрес или имя участника:\";'),('ru','messages:ipbexpiry','s:32:\"Закончится через:\";'),('ru','messages:ipbreason','s:15:\"Причина:\";'),('ru','messages:ipbreasonotherlist','s:27:\"Другая причина\";'),('ru','messages:ipbreason-dropdown','s:515:\"* Стандартные причины блокировок\n** Вставка ложной информации\n** Удаление содержимого страниц\n** Спам-ссылки на внешние сайты\n** Добавление бессмысленного текста/мусора\n** Угрозы, преследование участников\n** Злоупотребление несколькими учётными записями\n** Неприемлемое имя участника\";'),('ru','messages:ipb-hardblock','s:129:\"Запретить представившимся участникам редактирование с этого IP-адреса\";'),('ru','messages:ipbcreateaccount','s:76:\"Запретить создание новых учётных записей\";'),('ru','messages:ipbemailban','s:110:\"Запретить участнику отправлять письма по электронной почте\";'),('ru','messages:ipbenableautoblock','s:111:\"Автоматически блокировать используемые участником IP-адреса\";'),('ru','messages:ipbsubmit','s:65:\"Заблокировать этот адрес/участника\";'),('ru','messages:ipbother','s:24:\"Другое время:\";'),('ru','messages:ipboptions','s:211:\"2 часа:2 hours,1 день:1 day,3 дня:3 days,1 неделя:1 week,2 недели:2 weeks,1 месяц:1 month,3 месяца:3 months,6 месяцев:6 months,1 год:1 year,бессрочно:infinite\";'),('ru','messages:ipbotheroption','s:12:\"другое\";'),('ru','messages:ipbotherreason','s:51:\"Другая причина / дополнение:\";'),('ru','messages:ipbhidename','s:74:\"Скрыть имя участника из правок и списков\";'),('ru','messages:ipbwatchuser','s:150:\"Добавить в список наблюдения личную страницу участника и его страницу обсуждения\";'),('ru','messages:ipb-disableusertalk','s:159:\"Запретить этому участнику редактировать свою страницу обсуждения во время блокировки\";'),('ru','messages:ipb-change-block','s:86:\"Переблокировать участника с этими настройками\";'),('ru','messages:ipb-confirm','s:43:\"Подтвердить блокировку\";'),('ru','messages:badipaddress','s:152:\"IP-адрес записан в неправильном формате, или участника с таким именем не существует.\";'),('ru','messages:blockipsuccesssub','s:43:\"Блокировка произведена\";'),('ru','messages:blockipsuccesstext','s:160:\"[[Special:Contributions/$1|«$1»]] заблокирован.<br />\nСм. [[Special:IPBlockList|список заблокированных IP-адресов]].\";'),('ru','messages:ipb-blockingself','s:142:\"Вы пытаетесь заблокировать себя самого! Вы уверены, что вы хотите это сделать?\";'),('ru','messages:ipb-confirmhideuser','s:259:\"Вы намереваетесь заблокировать участника и скрыть его имя. Оно не будет отображаться в списках и журналах. Вы уверены, что хотите это сделать?\";'),('ru','messages:ipb-edit-dropdown','s:40:\"Править список причин\";'),('ru','messages:ipb-unblock-addr','s:31:\"Разблокировать $1\";'),('ru','messages:ipb-unblock','s:68:\"Разблокировать участника или IP-адрес\";'),('ru','messages:ipb-blocklist','s:60:\"Показать действующие блокировки\";'),('ru','messages:ipb-blocklist-contribs','s:32:\"Вклад участника $1\";'),('ru','messages:unblockip','s:42:\"Разблокировать IP-адрес\";'),('ru','messages:unblockiptext','s:214:\"Используйте форму ниже, чтобы восстановить возможность записи с