96:\"Заданный IP-адрес или имя участника не заблокированы.\";'),('ru','messages:blocklink','s:26:\"заблокировать\";'),('ru','messages:unblocklink','s:28:\"разблокировать\";'),('ru','messages:change-blocklink','s:37:\"изменить блокировку\";'),('ru','messages:contribslink','s:10:\"вклад\";'),('ru','messages:autoblocker','s:227:\"Автоблокировка из-за совпадения вашего IP-адреса с адресом, который недавно использовал [[User:$1|$1]].\nПричина блокировки $1 — «$2».\";'),('ru','messages:blocklogpage','s:33:\"Журнал блокировок\";'),('ru','messages:blocklog-showlog','s:204:\"{{GENDER:$1|Этот участник уже блокировался|Эта участница уже блокировалась}} ранее.\nНиже приведён журнал блокировок:\";'),('ru','messages:blocklog-showsuppresslog','s:129:\"Этот участник уже заблокирован и скрыт. Журнал сокрытий приведён ниже:\";'),('ru','messages:blocklogentry','s:55:\"заблокировал [[$1]] на период $2 $3\";'),('ru','messages:reblock-logentry','s:92:\"изменил настройки блокировки для [[$1]], истекает $2 $3\";'),('ru','messages:blocklogtext','s:297:\"Журнал блокирования и разблокирования участников.\nАвтоматически блокируемые IP-адреса здесь не указываются.\nСм. [[Special:BlockList|Список текущих запретов и блокировок]].\";'),('ru','messages:unblocklogentry','s:29:\"разблокировал $1\";'),('ru','messages:block-log-flags-anononly','s:56:\"только анонимные пользователи\";'),('ru','messages:block-log-flags-nocreate','s:71:\"запрещена регистрация учётных записей\";'),('ru','messages:block-log-flags-noautoblock','s:47:\"автоблокировка отключена\";'),('ru','messages:block-log-flags-noemail','s:46:\"отправка писем запрещена\";'),('ru','messages:block-log-flags-nousertalk','s:77:\"не может править свою страницу обсуждения\";'),('ru','messages:block-log-flags-angry-autoblock','s:54:\"включён расширенный автоблок\";'),('ru','messages:block-log-flags-hiddenname','s:38:\"имя участника скрыто\";'),('ru','messages:range_block_disabled','s:92:\"Администраторам запрещено блокировать диапазоны.\";'),('ru','messages:ipb_expiry_invalid','s:55:\"Недопустимый период действия.\";'),('ru','messages:ipb_expiry_temp','s:118:\"Блокировки с сокрытием имени участника должны быть бессрочными.\";'),('ru','messages:ipb_hide_invalid','s:145:\"Невозможно скрыть учётную запись, возможно, с неё сделано слишком много правок.\";'),('ru','messages:ipb_already_blocked','s:39:\"«$1» уже заблокирован.\";'),('ru','messages:ipb-needreblock','s:135:\"Участник $1 уже заблокирован. Желаете ли вы изменить параметры блокировки?\";'),('ru','messages:ipb-otherblocks-header','s:81:\"{{PLURAL:$1|Другая блокировка|Другие блокировки}}\";'),('ru','messages:unblock-hideuser','s:133:\"Вы не можете разблокировать этого участника, так как его имя было скрыто.\";'),('ru','messages:ipb_cant_unblock','s:117:\"Ошибка. Не найдена блокировка с ID $1. Возможно, она уже была снята.\";'),('ru','messages:ipb_blocked_as_range','s:297:\"Ошибка: IP-адрес $1 был заблокирован не напрямую и не может быть разблокирован. Однако, он принадлежит к заблокированному диапазону $2, который можно разблокировать.\";'),('ru','messages:ip_range_invalid','s:60:\"Недопустимый диапазон IP-адресов.\";'),('ru','messages:ip_range_toolarge','s:76:\"Блокировки диапазонов свыше /$1 запрещены.\";'),('ru','messages:blockme','s:29:\"Заблокируй меня\";'),('ru','messages:proxyblocker','s:33:\"Блокировка прокси\";'),('ru','messages:proxyblocker-disabled','s:34:\"Функция отключена.\";'),('ru','messages:proxyblockreason','s:341:\"Ваш IP-адрес заблокирован потому что это открытый прокси. Пожалуйста, свяжитесь с вашим интернет-провайдером  или службой поддержки и сообщите им об этой серьёзной проблеме безопасности.\";'),('ru','messages:proxyblocksuccess','s:19:\"Выполнено.\";'),('ru','messages:sorbsreason','s:84:\"Ваш IP-адрес числится как открытый прокси в DNSBL.\";'),('ru','messages:sorbs_create_account_reason','s:151:\"Ваш IP-адрес числится как открытый прокси в DNSBL. Вы не можете создать учётную запись.\";'),('ru','messages:cant-block-while-blocked','s:131:\"Вы не можете блокировать других участников, пока вы сами заблокированы.\";'),('ru','messages:cant-see-hidden-user','s:357:\"Участник, которого вы пытаетесь заблокировать, уже заблокирован и скрыт. Поскольку у вас нет разрешения на работу по сокрытию участников, вы не можете просмотреть или изменить данную блокировку.\";'),('ru','messages:ipbblocked','s:171:\"Вы не можете блокировать или разблокировать других участников, так как вы сами заблокированы\";'),('ru','messages:ipbnounblockself','s:73:\"Вы не можете разблокировать самого себя\";'),('ru','messages:lockdb','s:88:\"Сделать базу данных доступной только для чтения\";'),('ru','messages:unlockdb','s:85:\"Восстановить возможность записи в базу данных\";'),('ru','messages:lockdbtext','s:658:\"Блокировка базы данных приостановит для всех участников возможность редактировать страницы, изменять настройки,\nизменять списки наблюдения и производить другие действия, требующие доступа к базе данных.\nПожалуйста, подтвердите, что это — именно то, что вы хотите сделать, и что вы снимете блокировку как только закончите\nпроцедуру обслуживания базы данных.\";'),('ru','messages:unlockdbtext','s:483:\"Разблокирование базы данных восстановит для всех участников\nвозможность редактировать страницы, изменять настройки, изменять списки наблюдения и производить\nдругие действия, требующие доступа к базе данных.\nПожалуйста, подтвердите, что вы намерены это сделать.\";'),('ru','messages:lockconfirm','s:112:\"Да, я действительно хочу заблокировать базу данных на запись.\";'),('ru','messages:unlockconfirm','s:99:\"Да, я действительно хочу снять блокировку базы данных.\";'),('ru','messages:lockbtn','s:88:\"Сделать базу данных доступной только для чтения\";'),('ru','messages:unlockbtn','s:85:\"Восстановить возможность записи в базу данных\";'),('ru','messages:locknoconfirm','s:83:\"Вы не поставили галочку в поле подтверждения.\";'),('ru','messages:lockdbsuccesssub','s:48:\"База данных заблокирована\";'),('ru','messages:unlockdbsuccesssub','s:50:\"База данных разблокирована\";'),('ru','messages:lockdbsuccesstext','s:233:\"База данных проекта была заблокирована.<br />\nНе забудьте [[Special:UnlockDB|убрать блокировку]] после завершения процедуры обслуживания.\";'),('ru','messages:unlockdbsuccesstext','s:75:\"База данных проекта была разблокирована.\";'),('ru','messages:lockfilenotwritable','s:276:\"Нет права на запись в файл блокировки базы данных. Чтобы заблокировать или разблокировать БД, веб-сервер должен иметь разрешение на запись в этот файл.\";'),('ru','messages:databasenotlocked','s:63:\"База данных не была заблокирована.\";'),('ru','messages:lockedbyandtime','s:10:\"($1 $2 $3)\";'),('ru','messages:move-page','s:35:\"$1 — переименование\";'),('ru','messages:move-page-legend','s:45:\"Переименование страницы\";'),('ru','messages:movepagetext','s:1971:\"Воспользовавшись формой ниже, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.\nСтарое название станет перенаправлением на новое название.\nВы можете автоматически обновить перенаправления, которые вели на старое название.\nЕсли вы этого не сделаете, пожалуйста, проверьте наличие [[Special:DoubleRedirects|двойных]] и [[Special:BrokenRedirects|разорванных перенаправлений]].\nВы отвечаете за то, что бы ссылки продолжали и далее указывают туда, куда предполагалось.\n\nОбратите внимание, что страница \'\'\'не будет\'\'\' переименована, если страница с новым названием уже существует, кроме случаев, если она является перенаправлением или пуста и не имеет истории правок.\nЭто означает, что вы можете переименовать страницу обратно в то название, которое у него только что было, если вы переименовали по ошибке, но вы не можете случайно затереть существующую страницу.\n\n\'\'\'ПРЕДУПРЕЖДЕНИЕ!\'\'\'\nПереименование может привести к масштабным и неожиданным изменениям для \'\'популярных\'\' страниц.\nПожалуйста, прежде чем вы продолжите, убедитесь, что вы понимаете все возможные последствия.\";'),('ru','messages:movepagetext-noredirectfixer','s:1769:\"Воспользовавшись формой ниже, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.\nСтарое название станет перенаправлением на новое название.\nПожалуйста, проверьте наличие [[Special:DoubleRedirects|двойных]] и [[Special:BrokenRedirects|разорванных перенаправлений]].\nВы отвечаете за то, что бы ссылки продолжали и далее указывают туда, куда предполагалось.\n\nОбратите внимание, что страница \'\'\'не будет\'\'\' переименована, если страница с новым названием уже существует, кроме случаев, если она является перенаправлением или пуста и не имеет истории правок.\nЭто означает, что вы можете переименовать страницу обратно в то название, которое у него только что было, если вы переименовали по ошибке, но вы не можете случайно затереть существующую страницу.\n\n\'\'\'ПРЕДУПРЕЖДЕНИЕ!\'\'\'\nПереименование может привести к масштабным и неожиданным изменениям для \'\'популярных\'\' страниц.\nПожалуйста, прежде чем вы продолжите, убедитесь, что вы понимаете все возможные последствия.\";'),('ru','messages:movepagetalktext','s:562:\"Присоединённая страница обсуждения будет также автоматически переименована, \'\'\'кроме случаев, когда:\'\'\'\n\n*Не пустая страница обсуждения уже существует под таким же именем или\n*Вы не поставили галочку в поле ниже.\n\nВ этих случаях, вы будете вынуждены переместить или объединить страницы вручную, если это нужно.\";'),('ru','messages:movearticle','s:43:\"Переименовать страницу\";'),('ru','messages:moveuserpage-warning','s:313:\"\'\'\'Внимание.\'\'\' Вы собираетесь переименовать страницу участника. Пожалуйста, обратите внимание, что переименована будет только страница, участник \'\'\'не\'\'\' будет переименован.\";'),('ru','messages:movenologin','s:51:\"Вы не представились системе\";'),('ru','messages:movenologintext','s:172:\"Вы должны [[Special:UserLogin|представиться системе]],\nчтобы иметь возможность переименовать страницы.\";'),('ru','messages:movenotallowed','s:86:\"У вас нет разрешения переименовывать страницы.\";'),('ru','messages:movenotallowedfile','s:80:\"У вас нет разрешения переименовывать файлы.\";'),('ru','messages:cant-move-user-page','s:124:\"У вас нет разрешения переименовывать основные страницы участников.\";'),('ru','messages:cant-move-to-user-page','s:243:\"У вас нет разрешения преобразовывать какую-либо страницу в страницу в пространстве участника (за исключением подстраниц участника).\";'),('ru','messages:newtitle','s:27:\"Новое название\";'),('ru','messages:move-watch','s:77:\"Включить эту страницу в список наблюдения\";'),('ru','messages:movepagebtn','s:43:\"Переименовать страницу\";'),('ru','messages:pagemovedsub','s:43:\"Страница переименована\";'),('ru','messages:movepage-moved','s:66:\"\'\'\'Страница «$1» переименована в «$2»\'\'\'\";'),('ru','messages:movepage-moved-redirect','s:55:\"Было создано перенаправление.\";'),('ru','messages:movepage-moved-noredirect','s:76:\"Создание перенаправления было подавлено.\";'),('ru','messages:articleexists','s:217:\"Страница с таким именем уже существует или указанное вами название недопустимо.\nПожалуйста, выберите другое название.\";'),('ru','messages:cantmove-titleprotected','s:160:\"Невозможно переименовать страницу, так как новое название входит в список запрещённых.\";'),('ru','messages:talkexists','s:318:\"\'\'\'Страница была переименована, но страница обсуждения не может быть переименована, потому что страница с таким названием уже существует. Пожалуйста, объедините их вручную.\'\'\'\";'),('ru','messages:movedto','s:29:\"переименована в\";'),('ru','messages:movetalk','s:95:\"Переименовать соответствующую страницу обсуждения\";'),('ru','messages:move-subpages','s:59:\"Переименовать подстраницы (до $1)\";'),('ru','messages:move-talk-subpages','s:97:\"Переименовать подстраницы страницы обсуждения (до $1)\";'),('ru','messages:movepage-page-exists','s:128:\"Страница $1 уже существует и не может быть автоматически перезаписана.\";'),('ru','messages:movepage-page-moved','s:62:\"Страница $1 была переименована в $2.\";'),('ru','messages:movepage-page-unmoved','s:78:\"Страница $1 не может быть переименована в $2.\";'),('ru','messages:movepage-max-pages','s:298:\"$1 {{PLURAL:$1|страница была переименована|страницы было переименовано|страниц было переименовано}} — это максимум, больше страниц нельзя переименовать автоматически.\";'),('ru','messages:1movedto2','s:41:\"переименовал [[$1]] в [[$2]]\";'),('ru','messages:1movedto2_redir','s:85:\"переименовал [[$1]] в [[$2]] поверх перенаправления\";'),('ru','messages:move-redirect-suppressed','s:49:\"перенаправление подавлено\";'),('ru','messages:movelogpage','s:41:\"Журнал переименований\";'),('ru','messages:movelogpagetext','s:91:\"Ниже представлен список переименованных страниц.\";'),('ru','messages:movesubpage','s:59:\"{{PLURAL:$1|Подстраница|Подстраницы}}\";'),('ru','messages:movesubpagetext','s:113:\"У этой страницы $1 {{PLURAL:$1|подстраница|подстраницы|подстраниц}}.\";'),('ru','messages:movenosubpage','s:57:\"У этой страницы нет подстраниц.\";'),('ru','messages:movereason','s:15:\"Причина:\";'),('ru','messages:revertmove','s:10:\"откат\";'),('ru','messages:delete_and_move','s:44:\"Удалить и переименовать\";'),('ru','messages:delete_and_move_text','s:231:\"==Требуется удаление==\n\nСтраница с именем [[:$1|«$1»]] уже существует. Вы хотите её удалить, чтобы сделать возможным переименование?\";'),('ru','messages:delete_and_move_confirm','s:44:\"Да, удалить эту страницу\";'),('ru','messages:delete_and_move_reason','s:73:\"Удалено для возможности переименования\";'),('ru','messages:selfmove','s:140:\"Невозможно переименовать страницу: исходное и новое имя страницы совпадают.\";'),('ru','messages:immobile-source-namespace','s:112:\"Невозможно переименовывать страницы в пространстве имён «$1»\";'),('ru','messages:immobile-target-namespace','s:104:\"Невозможно переместить страницу в пространство имён «$1»\";'),('ru','messages:immobile-target-namespace-iw','s:118:\"Ссылка интервики не мож