ание на строку, и выберите хотите ли вы экспортировать всю историю изменений статей или только последние версии статей.\n\nВы также можете использовать специальный адрес для экспорта только последней версии. Например для страницы [[{{MediaWiki:Mainpage}}]] это будет адрес [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]].\";'),('ru','messages:exportcuronly','s:101:\"Включать только текущую версию, без полной предыстории\";'),('ru','messages:exportnohistory','s:192:\"----\n\'\'\'Замечание:\'\'\' экспорт полной истории изменений страниц отключён из-за проблем с производительностью.\";'),('ru','messages:export-submit','s:28:\"Экспортировать\";'),('ru','messages:export-addcattext','s:58:\"Добавить страницы из категории:\";'),('ru','messages:export-addcat','s:16:\"Добавить\";'),('ru','messages:export-addnstext','s:73:\"Добавить страницы из пространства имён:\";'),('ru','messages:export-addns','s:16:\"Добавить\";'),('ru','messages:export-download','s:55:\"Предложить сохранить как файл\";'),('ru','messages:export-templates','s:31:\"Включить шаблоны\";'),('ru','messages:export-pagelinks','s:70:\"Включить связанные страницы глубиной:\";'),('ru','messages:allmessages','s:37:\"Системные сообщения\";'),('ru','messages:allmessagesname','s:18:\"Сообщение\";'),('ru','messages:allmessagesdefault','s:34:\"Текст по умолчанию\";'),('ru','messages:allmessagescurrent','s:25:\"Текущий текст\";'),('ru','messages:allmessagestext','s:421:\"Это список системных сообщений, доступных в пространстве имён «MediaWiki».\nЕсли вы хотите внести вклад в общую локализацию MediaWiki, пожалуйста, посетите страницу [//www.mediawiki.org/wiki/Localisation описания локализации] и проект [//translatewiki.net translatewiki.net].\";'),('ru','messages:allmessagesnotsupportedDB','s:119:\"Эта страница недоступна, так как отключена опция \'\'\'$wgUseDatabaseMessages\'\'\'.\";'),('ru','messages:allmessages-filter-legend','s:12:\"Фильтр\";'),('ru','messages:allmessages-filter','s:52:\"Фильтр по статусу изменения:\";'),