s:442:\"Письмо с кодом подтверждения было отправлено на указанный вами почтовый ящик.\nДанный код не требуется для входа в систему, однако вы должны указать его,\nпрежде чем будет разрешено использование возможностей электронной почты в этом проекте.\";'),('ru','messages:confirmemail_sendfailed','s:258:\"{{SITENAME}} не может отправить письмо с запросом на подтверждение.\nПожалуйста, проверьте правильность адреса электронной почты.\n\nОтвет сервера: $1\";'),('ru','messages:confirmemail_invalid','s:112:\"Неправильный код подтверждения или срок действия кода истёк.\";'),('ru','messages:confirmemail_needlogin','s:115:\"Вы должны $1 для подтверждения вашего адреса электронной почты.\";'),('ru','messages:confirmemail_success','s:75:\"Ваш адрес электронной почты подтверждён.\";'),('ru','messages:confirmemail_loggedin','s:75:\"Ваш адрес электронной почты подтверждён.\";'),('ru','messages:confirmemail_error','s:141:\"Во время процедуры подтверждения адреса электронной почты произошла ошибка.\";'),('ru','messages:confirmemail_subject','s:104:\"{{SITENAME}}:Запрос на подтверждение адреса электронной почты\";'),('ru','messages:confirmemail_body','s:891:\"Кто-то (возможно вы) с IP-адресом $1 зарегистрировал\nна сервере проекта {{SITENAME}} учётную запись «$2»,\nуказав этот адрес электронной почты.\n\nЧтобы подтвердить, что вы эта учётная запись действительно\nпринадлежит вам и включить возможность отправки электронной почты\nс сайта {{SITENAME}}, откройте приведённую ниже ссылку в браузере.\n\n$3\n\nЕсли вы *не* регистрировали подобной учётной записи, то перейдите\nпо следующей ссылке, чтобы отменить подтверждение адреса\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_body_changed','s:850:\"Кто-то (возможно вы) с IP-адресом $1\nуказал данный адрес электронной почты в качестве нового для учётной записи «$2» в проекте {{SITENAME}}.\n\nЧтобы подтвердить, что эта учётная запись действительно принадлежит вам,\nи включить возможность отправки писем с сайта {{SITENAME}}, откройте приведённую ниже ссылку в браузере.\n\n$3\n\nЕсли данная учётная запись *не* относится к вам, то перейдите по следующей ссылке,\nчтобы отменить подтверждение адреса\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_body_set','s:817:\"Кто-то (возможно вы) с IP-адресом $1\nуказал данный адрес электронной почты для учётной записи «$2» в проекте {{SITENAME}}.\n\nЧтобы подтвердить, что эта учётная запись действительно принадлежит вам,\nи включить возможность отправки писем с сайта {{SITENAME}}, откройте приведённую ниже ссылку в браузере.\n\n$3\n\nЕсли данная учётная запись *не* относится к вам, то перейдите по следующей ссылке,\nчтобы отменить подтверждение адреса\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_invalidated','s:90:\"Подтверждение адреса электронной почты отменено\";'),('ru','messages:invalidateemail','s:73:\"Отменить подтверждение адреса эл. почты\";'),('ru','messages:scarytranscludedisabled','s:45:\"[«Interwiki transcluding» отключён]\";'),('ru','messages:scarytranscludefailed','s:54:\"[Ошибка обращения к шаблону $1]\";'),('ru','messages:scarytranscludetoolong','s:35:\"[Слишком длинный URL]\";'),('ru','messages:trackbackbox','s:48:\"Trackback для этой статьи:<br />\n$1\";'),('ru','messages:trackbackremove','s:21:\"([$1 удалить])\";'),('ru','messages:trackbacklink','s:9:\"Trackback\";'),('ru','messages:trackbackdeleteok','s:30:\"Trackback был удалён.\";'),('ru','messages:deletedwhileediting','s:138:\"\'\'\'Внимание\'\'\'. Эта страница была удалена после того, как вы начали её править!\";'),('ru','messages:confirmrecreate','s:350:\"Участник [[User:$1|$1]] ([[User talk:$1|обсуждение]]) удалил эту страницу после того, как вы начали её редактировать, причина удаления:\n: \'\'$2\'\'\nПожалуйста, подтвердите, что вы хотите восстановить эту страницу.\";'),('ru','messages:confirmrecreate-noreason','s:335:\"Участник [[User:$1|$1]] ([[User talk:$1|обсуждение]]) удалил эту 