INSERT INTO `text` VALUES (1,'\'\'\'Вики-движок «MediaWiki» успешно установлен.\'\'\'\n\nИнформацию по работе с этой вики можно найти в [//meta.wikimedia.org/wiki/%D0%9F%D0%BE%D0%BC%D0%BE%D1%89%D1%8C:%D0%A1%D0%BE%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%BD%D0%B8%D0%B5 справочном руководстве].\n\n== Некоторые полезные ресурсы ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Список возможных настроек];\n* [//www.mediawiki.org/wiki/Manual:FAQ Часто задаваемые вопросы и ответы по MediaWiki];\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Рассылка уведомлений о выходе новых версий MediaWiki].','utf-8'),(2,'\'\'\'Welcome to CV BASE!\'\'\'\n \n\nМы складываем кандидатов и историю по контактам СЮДА.\n\nВсе что неудобно в этом recruiting tool можно обсуждать и изменять.\n\n\n\nОзнакомьтесь с [[Руководство|руководством]] по данному сервису.\n \n\n=== Новая персона  ===\n\n{{#forminput:form=Персона|autocomplete on category=Персоны|size=80|button text=Ввести}}\n\n\n== Тэги  ==\n<tagcloud></tagcloud>','utf-8'),(3,'* Human Resource\n** mainpage|Главная\n** Form:Персона|Новая персона\n** Form:Специализация|Специализация\n** Category:Персоны|Весь список\n** Category:Специализации|Все специализации\n** Category:История|Истории контактов\n** Category:Референсы|Все референсы\n** Последние|Последние\n*SEARCH\n*TOOLBOX\n*LANGUAGES','utf-8'),(4,'* Human Resource\n** mainpage|Главная\n** Form:Персона|Новая персона\n** Form:Специализация|Специализация\n** Category:Персоны|Весь список\n** Category:Специализации|Все специализации\n** Category:История|Истории контактов\n** Category:Референсы|Все референсы\n** Последние|Последние\n*SEARCH\n*TOOLBOX\n*LANGUAGES','utf-8'),(5,'* Human Resource\n** mainpage|Главная\n** Form:Персона|Новая персона\n** Form:Специализация|Специализация\n** Category:Персоны|Весь список\n** Category:Специализации|Все специализации\n** Category:История|Истории контактов\n** Category:Референсы|Все референсы\n** Последние|Последние\n\n*SEARCH\n\n*TOOLBOX','utf-8'),(6,'* Human Resource\n** mainpage|Главная\n** Form:Персона|Новая персона\n** Form:Специализация|Специализация\n** Category:Персоны|Весь список\n** Category:Специализации|Все специализации\n** Category:История|Истории контактов\n** Category:Референсы|Все референсы\n** Последние|Последние\n\n* SEARCH\n\n* TOOLBOX','utf-8'),(7,'==== Как добавить персону?  ====\n\nДобавить персону можно либо с [[Main Page|главной страницы]], либо выбрав пункт [[Form:Персона|Новая персона]].<br>Вводить данные следует на русском языке, сначала фамилию, потом имя. Все слова с заглавных букв.<br>Если такая запись уже есть, то она откроется для редактирования. Следует помнить, что ввод регистро-зависимый\n \n\n==== Поля ввода формы  ====\n\nФорма имеет несколько стандартных полей:\n\n*Фамилия Имя Отчество (заполняются по русски через проблем с Заглавной буквы)\n*Английский вариант написания\n*Контактные телефоны (можно написать несколько телефонов через запятую)\n*Почта (можно написать несколько адресов через запятую)\n*Skype (если есть скайп, указывается один аккаунт для связи, сюда следует вписать именно login для скайпа)\n*Специализация (через запятую, с заглавной буквы, указываются все специализации персоны, например, PHP, Java, Administrator, QA, Manager и т.д.). Если специализация не существует, то она создастся автоматически\n*Резюме (к персоне можно приаттачить несколько резюме, названия файлов пишутся через запятую). &nbsp;Внимание! Когда аттачишь больше одного резюме есть баг, см. ниже\n*Краткая информация (поле для отметок со свободным текстом)\n\n==== Отзывы  ====\n\nПроцесс добавления отзыва для персоны очень прост:\n&nbsp;\n\n#Выбрать нужного кандидата\n#Нажать \"edit with form\"\n#Нажать \"добавить ещё один отзыв\"\n#Ввести автора отзыва\n#Ввести отзыв\n#Сохранить\n\n*\n\n==== Специализации  ====\n\nСпециализации добавляются автоматически, но при желании их можно создать отдельно.<br>Для этого есть форма [[Form:Специализация|Новая специализация]]\n\n==== Как приаттачить несколько резюме? ====\n\nОкно для загрузки резюме затирает старое название файла.\nСами же файлы резюме в поле можно перечислять через запятую. Поэтому, для того, чтобы добавить ещё одно резюме, вам надо:\n# Скопировать в буфер обмена всё что там написано\n# Загрузить новое резюме\n# Поставить запятую и после неё вставить то, что было в буфере\n\n\n# \'\'\'Скопировать в буфер обмена всё что там написано\'\'\' - это важный момент, который позволяет сохранить видимыми в строке и в профиле ВСЕ приаттаченные документы\n\n==== Пытаюсь приаттачить резюме, пишет что такое уже есть ====\n\nЭто значит, что в системе уже есть файл с точно таким же именем. Возможно это даже один и тот же файл.\nВам следует либо дать другое имя, либо отменить загрузку нового файла и в поле формы вписать имя файла, который уже есть в базе\n\n==== Поиск ====\n\nСлева введите ключевые слова по которым вы хотите искать. Если вы хотите искать также и в резюме персон, то вам необходимо отметить пространство \"File\" в расширенном поиске.\n\n==== Категории специализации ====\n\nЕсли вам необходимо найти персон по их специализации, вам помогут категории. Выберете пункт меню \"Все специализации\". \nУ вас будет полный доступный список всех специализаций. Выберете нужную и получите список персон, принадлежащих к этой специализации.\n\n==== Когда я выбираю специализацию, список персон пуст  ====\n\nЭто может быть связано с тем, что страница динамически обновляется только во время сохранения. Просто нажмите \"edit\", а затем сохраните страницу.\n\n==== Как исправлять поля формы  ====\n\nЧтобы исправить поле формы (например, опечатку), можно:\n\n# Открыть любого кандидата\n# Выбрать пункт меню edit (не edit with form)\n# Внизу нажать кнопку edit напротив Edit Template:Персона\n# Просмотреть появившуюся страницу и исправить все ошибки\n# Сохранить шаблон','utf-8'),(8,'testing file searching','utf-8'),(9,'testing file searching\n<!-- FI:INDEX-START -->{{FileIndex |index=testing parsing file keyword trouble  }}<!-- FI:INDEX-ENDE -->','utf-8'),(10,'Это свойство типа [[Имеет тип::Почта]].','utf-8'),(11,'Это свойство типа [[Имеет тип::Строка]].','utf-8'),(12,'Это свойство типа [[Имеет тип::Строка]].','utf-8'),(13,'Это свойство типа [[Имеет тип::Текст]].','utf-8'),(14,'Это свойство типа [[Имеет тип::Текст]].','utf-8'),(15,'Это свойство типа [[Имеет тип::Строка]].','utf-8'),(16,'Это свойство типа [[Имеет тип::Текст]].','utf-8'),(17,'Это свойство типа [[Имеет тип::Строка]].','utf-8'),(18,'Это свойство типа [[Имеет тип::Страница]]. Ссылки на страницы, использующие форму [[::Специализация]].','utf-8'),(19,'Это свойство типа [[Имеет тип::Страница]]. Ссылки на страницы, использующие форму [[Creates pages with form::Специализация]].','utf-8'),(20,'<noinclude>\nЭто шаблон «Специализация». Он должен вызываться следующим образом:\n<pre>\n{{Специализация\n|=\n}}\n</pre>\nНачните редактировать эту страницу, чтобы увидеть текст шаблона.\n</noinclude><includeonly>{| class=\"wikitable\"\n! \n| {{{|}}}\n|}\n</includeonly>','utf-8'),(21,'<noinclude>\nThis is the \"Специализация\" template.\nIt should be called in the following format:\n<pre>\n{{Специализация}}\n</pre>\nEdit the page to see the template text.\n</noinclude><includeonly>\n{| class=\"wikitable\"\n! \n| {{#ask:[[Специализация::{{SUBJECTPAGENAME}}]]|format=table|mainlabel=Персона}}\n|}\n[[Category:Специализации]]\n</includeonly>','utf-8'),(22,'<noinclude>\nЭто шаблон «Референс». Он должен вызываться следующим образом:\n<pre>\n{{Референс\n|=\n}}\n</pre>\nНачните редактировать эту страницу, чтобы увидеть текст шаблона.\n</noinclude><includeonly>{| class=\"wikitable\"\n! \n| {{{|}}}\n|}\n</includeonly>','utf-8'),(23,'<noinclude>\nThis is the \"Референс\" template.\nIt should be called in the following format:\n<pre>\n{{Референс\n|Автор референса=\n|Отзыв=\n}}\n</pre>\nEdit the page to see the template text.\n</noinclude><includeonly>\n<b>Референс от: [[Автор отзыва::{{{Автор референса|}}}]] (Дата: {{{Дата|}}})</b><hr/>\n