еть текст шаблона.\n</noinclude><includeonly>{| class=\"wikitable\"\n! \n| {{{|}}}\n|}\n</includeonly>','utf-8'),(28,'<noinclude>\nThis is the \"История\" template.\nIt should be called in the following format:\n<pre>\n{{История\n|Автор отзыва=\n|Отзыв=\n}}\n</pre>\nEdit the page to see the template text.\n</noinclude><includeonly>\n<b style=\"color: #1010DD;\">История контакта: [[Автор отзыва::{{{Автор отзыва|}}}]] (Дата: {{{Дата|}}})</b><hr/>\n[[Отзыв::{{{Отзыв|}}}]]\n\n[[Category:История]]\n</includeonly>','utf-8'),(29,'<noinclude>\nЭто форма «Персона».\nЧтобы создать страницу с помощью этой формы, введите ниже название страницы;\nесли страница с таким именем уже существует, вы будите направлены на форму редактирования этой страницы.\n\n\n{{#forminput:form=Персона}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Персона|label=}}}\n{| class=\"formtable\"\n! ФИО:\n| {{{field|ФИО}}}\n|-\n! FMS:\n| {{{field|FMS}}}\n|-\n! Телефон:\n| {{{field|Телефон|hidden}}}\n|-\n! Почта:\n| {{{field|Почта}}}\n|-\n! Skype:\n| {{{field|Skype}}}\n|-\n! Специализация:\n| {{{field|Специализация}}}\n|-\n! Резюме:\n| {{{field|Резюме}}}\n|-\n! Фидбэк:\n| {{{field|Фидбэк}}}\n|-\n! Краткая информация:\n| {{{field|Краткая информация}}}\n|}\n{{{end template}}}\n\n\'\'\'Текст:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(30,'<noinclude>Для того чтобы внести новую персону в базу необходимо по \'\'\'русски через пробел написать фамилию и имя\'\'\'.\nВвод чувствителен к регистру! Вводить следует все слова \'\'\'с заглавной буквы\'\'\', например: \n\n\"\'\'\'Иванов Иван\'\'\'\"\n\nЕсли такой человек уже есть в базе - откроется его страница, иначе будет создана новая\n\n\n{{#forminput:form=Персона|80||Ввести||autocomplete on category=Персоны}}\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Персона}}}\n{| class=\"formtable\"\n! Фамилия Имя Отчество\n| {{{field|ФИО|mandatory}}}\n|-\n! (ENG) First Name, Middle Name, Surname\n| {{{field|FMS|mandatory}}}\n|-\n! Телефон:\n| {{{field|Телефон|multiple}}}\n|-\n! Почта:\n| {{{field|Почта|multiple}}}\n|-\n! Skype:\n| {{{field|Skype}}}\n|-\n! Специализация:\n| {{{field|Специализация|mandatory|multiple|autocomplete on property=Специализация}}}\n|-\n! Резюме:\n| {{{field|Резюме|multiple|uploadable}}}\n|-\n! Фидбэк:\n| {{{field|Фидбэк|multiple|uploadable}}}\n|-\n! Краткая информация:\n| {{{field|Краткая информация}}}\n|}\n{{{end template}}}\n<h1>Истории</h1>\n{{{for template|История|multiple|add button text=Добавить ещё одну историю контакта}}}\n\n\'\'\'Автор:\'\'\' {{{field|Автор отзыва}}}\n\'\'\'Дата:\'\'\' {{{field|Дата|input type=date|default=now}}}\n\n\'\'\'Текст:\'\'\' {{{field|Отзыв}}}\n\n{{{end template}}}\n<h1>Референсы</h1>\n{{{for template|Референс|multiple|add button text=Добавить ещё один референс}}}\n\n\'\'\'Автор референса:\'\'\' {{{field|Автор референса}}}\n\'\'\'Дата:\'\'\' {{{field|Дата|input type=date|default=now}}}\n\n\'\'\'Текст:\'\'\' {{{field|Отзыв}}}\n\n{{{end template}}}\n\n\'\'\'Free text:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(31,'<noinclude>\nЭто форма «Специализация».\nЧтобы создать страницу с помощью этой формы, введите ниже название страницы;\nесли страница с таким именем уже существует, вы будите направлены на форму редактирования этой страницы.\n\n\n{{#forminput:form=Специализация}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Специализация|label=}}}\n{| class=\"formtable\"\n|}\n{{{end template}}}\n\n\'\'\'Текст:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(32,'<noinclude>\nТут можно ввести новую специализацию для персоны, например, QA, Automated QA, .NET, PHP, и так далее.\n\n\n{{#forminput:form=Специализация|80||Ввести}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Специализация}}}\n{| class=\"formtable\"\n! Персоны:\n| {{#ask:[[Специализация::{{SUBJECTPAGENAME}}]]|format=list}}\n|}\n{{{end template}}}\n\n\'\'\'Free text:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8');
